S profile.  Other useful views:\\r\\n\\t\\t\\t\\t[administrators](/admin.view), [security](/files.view), [machine learner developers](/engines.view),\\r\\n\\t\\t\\t\\t[project scientist](/project.view), [proof editors](/files.view).\\r\\n\\r\\n\\t\\t\\tp $$ J_\\\\alpha(x) = \\\\sum\\\\limits_{m=0}^\\\\infty \\\\frac{(-1)^m}{m! \\\\, \\\\Gamma(m + \\\\alpha + 1)}{\\\\left({\\\\frac{x}{2}}\\\\right)}^{2 m + \\\\alpha} $$\\r\\n\\r\\n\\t\\t\\t:markdown\\r\\n\\t\\t\\t\\tDont forget to check-out the [geoNode home](/home.view) for other exciting **geoNode** products.\\t\\t\\t\\r\\n\\r\\n\\t\\t\\t#grid.Search(\\r\\n\\t\\t\\t\\tpath=\\\"/CATALOG.db\\\",center,crush,\\r\\n\\t\\t\\t\\thead=\\\"Search,Execute,Print,Refresh\\\",\\r\\n\\t\\t\\t\\tpage=100,dims=\\\"#{dims}\\\",\\r\\n\\t\\t\\t\\tsearch=\\\"Content\\\",\\r\\n\\t\\t\\t\\tcols=\\\"Ref,Name,Link.h,Dated.d,Searched\\\")\\r\\n\\r\\n\\telse\\r\\n\\t\\t#hold.Execute(path=\\\"/states.db?Class=Detector\\\",cols=\\\"Name,Name\\\")\\r\\n\\t\\t#hold.Action(path=\\\"/states.db?Class=Action\\\",cols=\\\"Name,Name\\\")\\r\\n\\r\\n\\t\\t//\\r\\n\\t\\t\\t#hold.PosCases(path=\\\"/positives.FILES.db\\\",cols=\\\"Name,File\\\")\\r\\n\\t\\t\\t#hold.NegCases(path=\\\"/negatives.FILES.db\\\",cols=\\\"Name,File\\\")\\r\\n\\r\\n\\t\\t#folder.SWAG\\r\\n\\r\\n\\t\\t\\t:markdown\\r\\n\\t\\t\\t\\tSWAG (Structerd Wide Area GEOINT) provides an R&D testbed (framework or environment) of\\r\\n\\t\\t\\t\\tjpg-ready machine learners that semi-autonomously creates and operates a pool of \\r\\n\\t\\t\\t\\tfeature detectors matched to specific backgrounds.  In this way SWAG exploits NTM-commerical \\r\\n\\t\\t\\t\\tEO imagery on its classified-unclassified systems to (1) estimate the performance of\\r\\n\\t\\t\\t\\tfuture Chinese sensors incorporating its low-power machine learner, and (2) utilize its \\r\\n\\t\\t\\t\\thigh-power learners for indexing NTM imagery prior to long term archival.  \\r\\n\\r\\n\\t\\t\\t\\tSWAG is architected to support NGA\'s SOM, OpenIT, Content Management goals and its \\r\\n\\t\\t\\t\\ttwo main objectives support NGA\'s Future Sensor portfolio.\\r\\n\\t\\t\\t\\t\\r\\n\\t\\t\\t\\tSWAG is not an operational system; rather, SWAG seeks to suport operational systems\\r\\n\\t\\t\\t\\tby providing a cloud compute testbed to evaluate machine learners.\\r\\n\\r\\n\\t\\t\\t#grid.News(\\r\\n\\t\\t\\t\\tpath=\\\"news.db\\\",\\r\\n\\t\\t\\t\\tsorts=\\\"Stay,Starts\\\",page=30,dims=\\\"#{dims}\\\",calc,head=\\\"Search,Print,Refresh\\\",\\r\\n\\t\\t\\t\\tcols=\\\"Message.h\\\")\\r\\n\\r\\n\\t\\t\\t\\t:markdown\\r\\n\\t\\t\\t\\t\\tThe rules governing the periodic roll-off and update of these news items can \\r\\n\\t\\t\\t\\t\\tbe adjusted [here](/home.view?option=newsedit).\\r\\n\\r\\n\\t\\t\\t#fit.Conops\\r\\n\\t\\t\\t\\r\\n\\t\\t\\t\\t:markdown\\r\\n\\t\\t\\t\\t\\tSWAG (Structerd Wide Area GEOINT) provides an R&D testbed (framework or environment) of\\r\\n\\t\\t\\t\\t\\tjpg-ready machine learners that semi-autonomously creates and operates a pool of \\r\\n\\t\\t\\t\\t\\tfeature detectors matched to specific backgrounds.  In this way SWAG exploits NTM-commerical \\r\\n\\t\\t\\t\\t\\tEO imagery on its classified-unclassified systems to (1) estimate the performance of\\r\\n\\t\\t\\t\\t\\tfuture Chinese sensors incorporating its low-power machine learner, and (2) utilize its \\r\\n\\t\\t\\t\\t\\thigh-power learners for indexing NTM imagery prior to long term archival.\\r\\n\\t\\t\\t\\t\\t\\r\\n\\t\\t\\t\\t\\tWhen SWAG happens over an area with known ground truth (e.g. when a BE is encounted in\\r\\n\\t\\t\\t\\t\\tthe NTM channel), SWAG updates the ROC (false-alarm, hit-rate) score of all detectors\\r\\n\\t\\t\\t\\t\\tin the same focus area.  By retaining detector ROC curves, SWAG can intelligently boosting\\r\\n\\t\\t\\t\\t\\tthe hypothesis from all detectors, thus creating a stronger detector from a pool of\\r\\n\\t\\t\\t\\t\\tweaker detectors.\\r\\n\\t\\t\\t\\t\\t\\r\\n\\t\\t\\t\\t\\tDefine your Areas of Interest (by country, BE, sensor, etc) in the [AOI Filter](/swag.view?goto=AOI Filter),\\r\\n\\t\\t\\t\\t\\tthen let the tipper deliver image chips over this AOI to [your detectors](/swag.view?goto=Detectors).\\r\\n\\t\\t\\t\\t\\t[Detection events](/swag.view?goto=Detections) can be consulted at any time.  The automatically populated\\r\\n\\t\\t\\t\\t\\t[training and detection jobs](/swag.view?goto=Jobs) can be managed by your job queue strategies/priorites.\\r\\n\\t\\t\\t\\t\\tTry [liking us](/likeus.view) to improve your priority in the job queues.\\r\\n\\t\\t\\t\\t\\t\\r\\n\\t\\t\\t\\t\\tBefore you can attach a detector to an AOI, the detector will need to be trained.  If your detector (positive\\r\\n\\t\\t\\t\\t\\tfeature over negative background) does not yet exists, clone or revise an existing detector, tune its\\r\\n\\t\\t\\t\\t\\tparameters, attach it to an AOI, then Execute (train) it to put it in the job queue.\\r\\n\\t\\t\\t\\t\\t\\r\\n\\t\\t\\t\\t\\tHow are your detectors doing today?  Inpsect their [ROC performance](/swag.view?goto=ROC).\\r\\n\\t\\t\\t\\t\\t\\r\\n\\t\\t\\t\\t\\tFind an under-performing detector?  Begone with thee!  Simply go to [your detector](/swag.view?goto=Detectors)\\r\\n\\t\\t\\t\\t\\tand disconnect it from its AOI(s).  Or perhaps your feeling more kindly and would like to give\\r\\n\\t\\t\\t\\t\\tyour detector a second chance?  Then, leave it connected, adjust more aggressive training parameters,\\r\\n\\t\\t\\t\\t\\tthe Execute (train) it.  Most machine provide some form of \\\"transfer leaning\\\" and will thus continue\\r\\n\\t\\t\\t\\t\\ttraining your detector from its current state.\\r\\n\\t\\t\\t\\t\\t\\r\\n\\t\\t\\t\\t\\tWant to add a better machine learner?  Simply copy-and-paste your Python, Matlab-like, or \\r\\n\\t\\t\\t\\t\\tJS code (or bind your C code) into one of SWAG\'s [language agnostic engines](/engines.view).\\r\\n\\t\\t\\t\\t\\tSoon you will be able to use these engines in [workflows](/nodeflow.view) as well.\\r\\n\\t\\t\\t\\t\\t\\r\\n\\t\\t\\t\\t\\tConsult the [FAQs]() for additional Heilmier related thoughts.\\r\\n\\r\\n\\t\\t\\t#fit.Status.and.POCs\\r\\n\\t\\t\\t\\t:markdown\\r\\n\\t\\t\\t\\t\\tPlease note that SWAG is non-operational and thus enjoys no funding of any kind.  NGA/IIG thus\\r\\n\\t\\t\\t\\t\\treserves the exclusive right to terminate SWAG at and time without notice.\\r\\n\\t\\t\\t\\t\\t\\r\\n\\t\\t\\t\\t\\tProject status can be found [here](http://jira.dev.ic.gov/jira/browse/GRD-1527) and \\r\\n\\t\\t\\t\\t\\t[here](http://jira.dev.ic.gov/jira/browse/GRD-1700) for the NTM and commerical systems, \\r\\n\\t\\t\\t\\t\\trespectively.\\r\\n\\t\\t\\t\\t\\t\\r\\n\\t\\t\\t\\t\\tFor additional information, please contact:  \\r\\n\\t\\t\\t\\t\\t*\\t[Brian James](mailto://brian.d.james@nga.ic.gov) 811-1285  or [low-side](mailto://brian.d.james@nga.mil) 571-721-3589  \\r\\n\\t\\t\\t\\t\\t*\\t[Duncan McCharthy](mailto://duncan.l.mccharthy@nga.ic.gov) 578-6240  \\r\\n\\t\\t\\t\\t\\t*\\t[David Castor](mailto://david.m.castor@nga.ic.gov) TBD  \\r\\n\\t\\t\\t\\t\\t*\\t[Scott VanDusen](mailto://scott.w.vandusen@nga.ic.gov) TBD  \\r\\n\\t\\t\\t\\t\\t*\\t[Will King](mailto://william.t.king@nga.ic.gov) 811-1384  \\r\\n\\r\\n\\t\\t\\t\\t\\tNGA/IIG is developing a SWAG prototype under a JIRA projects GRD-1527,1700 with intent to deliver\\r\\n\\t\\t\\t\\t\\ta machine learning service assessable with the [GIAT R&D infrastructure](http://intellipedia.intelink.ic.gov/wiki/GIAT):\\r\\n\\t\\t\\t\\t\\tGEOHUB, C2S, ILE, and AWS are just four [ISPs](/requirements.view?goto=ISP) under\\r\\n\\t\\t\\t\\t\\tevaluation.  There are presently **NO** active plans to transition this technology\\r\\n\\t\\t\\t\\t\\tto an operational environment.\\r\\n\\r\\n\\t\\t\\t#tutorial.Briefing(dims=\\\"#{dims}\\\",refresh=\\\"1\\\")\\r\\n\\t\\t\\t\\r\\n\\t\\t\\t#fit.Disclaimers\\r\\n\\t\\t\\t\\t:markdown\\r\\n\\t\\t\\t\\t\\tPlease note that SWAG is non-operational and thus enjoys no funding of any kind.  NGA/IIG thus\\r\\n\\t\\t\\t\\t\\treserves the exclusive right to terminate SWAG at and time without notice.\\r\\n\\t\\t\\t\\r\\n\\t\\t\\t\\t\\tNGA does not, under any circumstance, warrant, underwrite, endorse, promote or sell\\r\\n\\t\\t\\t\\t\\tany technologies used herein.  Use this service at your own risk.  Changes to \\r\\n\\t\\t\\t\\t\\t[SWAG\'s build-to requirements](/requirements.view) must be coordinated through\\r\\n\\t\\t\\t\\t\\tNGA IIG\'s [agile project management system](http://jira.dev.ic.gov/jira).  See\\r\\n\\t\\t\\t\\t\\t[SWAG\'s TTA/EULA](/requirements.view?goto=TTA) for additional technology \\r\\n\\t\\t\\t\\t\\ttransfer and end-user agreement information.  SWAG welcomes your [issues, bugs, and \\r\\n\\t\\t\\t\\t\\tideas](/issues.view).\\r\\n\\t\\t\\t\\t\\t\\r\\n\\t\\t\\t#fit.Architecture\\r\\n\\t\\t\\t\\t:markdown\\r\\n\\t\\t\\t\\t\\tSWAG currently endores the OpenCV (low-power), Theano (high-power), and Caffe (high-power)\\r\\n\\t\\t\\t\\t\\tmachine learning frameworks spanning low-high power compute clouds (w/o and w GPU support).\\r\\n\\r\\n\\t\\t\\t\\t\\tSWAG\'s classified (unclassified) systems ingests IDOPs tipped by HYDRA (Enhanced View),\\r\\n\\t\\t\\t\\t\\tthen orthorectifed and chipped by OMAR (Enhanced View), then circulates jpgs to all \\r\\n\\t\\t\\t\\t\\tdetectors sharing that area of interest.  Detectors -- those automatically built\\r\\n\\t\\t\\t\\t\\tby the machine learners -- return to SWAG a JSON-formatted detection event list.\\r\\n\\t\\t\\t\\t\\t\\r\\n\\t\\t\\t\\t\\tSWAG integrates mature chipping (e.g. OMAR, JPIP streaming, Digital Globe Enhanced View), \\r\\n\\t\\t\\t\\t\\tquery (e.g. Hydra, DGEV) into mature [hyperthreaded workflows](/exsite.view?options=workflows)\\r\\n\\t\\t\\t\\t\\trunning language agnostic (Python, Matlab-like, JS, or C) engines.\\r\\n\\r\\n\\t\\t\\t\\t\\tWhile SWAG has currently consumed the OpenCV machine learning framework -- low-power\\r\\n\\t\\t\\t\\t\\tlearners built by the Russians for future Chinese millitary sensors -- SWAG has reserved\\r\\n\\t\\t\\t\\t\\tthe Theano LeNet and Caffe engines for its high-power (GPU CUDA assisted) \\r\\n\\t\\t\\t\\t\\tlearners.  SWAG also has interest in the Torch7 and OverFear learners.\\r\\n\\t\\t\\t\\t\\t\\r\\n\\t\\t\\t\\t\\tSWAG thus seeks to support a wide range of neural network machine learners including\\r\\n\\t\\t\\t\\t\\tdecision, SVM and softmax capped convolutional, fully convolutional, attractor, and \\r\\n\\t\\t\\t\\t\\tself organizing neural networks to provide detection and symantic segmentation\\r\\n\\t\\t\\t\\t\\tof NTM-commerical images.\\r\\n\\t\\t\\t\\t\\t\\r\\n\\t\\t\\t\\t\\tData mining and workflow management are key concepts utilized by SWAG.  Architected \\r\\n\\t\\t\\t\\t\\taround web-sockets, a JS-everywhere philosophy, and client-defined skins, SWAG \\r\\n\\t\\t\\t\\t\\tsuppports the OpenIT and Content Management goals of many organizations.  Consult\\r\\n\\t\\t\\t\\t\\tthe [Briefing](\\\\swag.view?goto=Briefing) for detailed architecture drawings.\\r\\n\\r\\n\\t\\t\\t#fit.FAQs\\r\\n\\r\\n\\t\\t\\t#fit.Configure\\r\\n\\t\\t\\t\\t#form.Workflow.Parameters(\\r\\n\\t\\t\\t\\t\\tpath=\\\"/config.db\\\",\\r\\n\\t\\t\\t\\t\\tdims=\\\"#{dims}\\\",crush,\\r\\n\\t\\t\\t\\t\\thead=\\\"Insert,Update,Delete,Select,Execute,Refresh,Restart\\\",Restart=\\\"/start.sys\\\",\\r\\n\\t\\t\\t\\t\\tcols=\\\"Hawks(SetPoint,MaxFaults.i,Hawks.c),Regulators(QoS0.n,QoS1.n,QoS2.n,QoS3.n,QoS4.n),Chip Cache(MaxAge.n),Services(WMS,WFS)\\\")\\r\\n\\r\\n\\t\\t\\t\\t#grid.Forecasting.Models(\\r\\n\\t\\t\\t\\t\\tpath=\\\"/models.db\\\",\\r\\n\\t\\t\\t\\t\\tdims=\\\"#{dims}\\\",crush,\\r\\n\\t\\t\\t\\t\\thead=\\\"Insert,Update,Delete,Select,Execute,Refresh,Restart\\\",Restart=\\\"/start.sys\\\",\\r\\n\\t\\t\\t\\t\\tcols=\\\"enabled.c,name,srcs.x,rots.x,sizes.x,flips.x,levels.x\\\")\\r\\n\\r\\n\\t\\t#folder.Detectors\\r\\n\\t\\t\\r\\n\\t\\t\\t:markdown\\r\\n\\t\\t\\t\\tNGA does not, under any circumstance, warrant, underwrite, endorse, promote or sell\\r\\n\\t\\t\\t\\tany technologies used herein.  Use this service at your own risk.  Changes to \\r\\n\\t\\t\\t\\t[SWAG\'s build-to requirements](/requirements.view) must be coordinated through\\r\\n\\t\\t\\t\\tNGA IIG\'s [agile project management system](http://jira.dev.ic.gov/jira).  See\\r\\n\\t\\t\\t\\t[SWAG\'s TTA/EULA)(/requirements.view?goto=TTA) for additional technology \\r\\n\\t\\t\\t\\ttransfer and end-user agreement information.  SWAG welcomes your [issues, bugs, and \\r\\n\\t\\t\\t\\tideas](/issues.view).\\r\\n\\t\\t\\t\\t\\r\\n\\t\\t\\t#grid.GMS(\\r\\n\\t\\t\\t\\tpath=\\\"/detectors.db\\\", \\r\\n\\t\\t\\t\\tdims=\\\"#{dims}\\\",page=\\\"#{page}\\\",\\r\\n\\t\\t\\t\\tcols=\\\"Enabled.c,Name,Execute.p,MaxDirty.n,Quality(Evaled.d,Dirty.n,Stars.n,Client),Proofs(PosCases.h,NegCases.h,Overhead.c),Sampling(Samples.i,ImageBg.i,ImageDev.i,Projections(xRotate.n,yRotate.n,zRotate.i)),Training(ROC(Data(MaxPos.i,MaxNeg.i),HAAR(Width.i,Height.i),MaxStages.i,MinTPR.n,MaxFPR.n),Tweak(MaxDepth.i,MaxWeak.i,TrimRate.n)),Detection(Channel,Pixels.i,Pack.i,Feature.n,Hits.i,SizeRange.n,SizeStep.n)\\\")\\r\\n\\r\\n\\t\\t\\t\\t:markdown\\r\\n\\t\\t\\t\\t\\tThis is the Godel Mathematical Society (HAAR neural network) learning machine.\\r\\n\\r\\n\\t\\t\\t#grid.CNN(\\r\\n\\t\\t\\t\\tpath=\\\"/detectors.db\\\", \\r\\n\\t\\t\\t\\tdims=\\\"#{dims}\\\",page=\\\"#{page}\\\",\\r\\n\\t\\t\\t\\tcols=\\\"Name\\\")\\r\\n\\r\\n\\t\\t\\t\\t:markdown\\r\\n\\t\\t\\t\\t\\tReserved for Convolutional Neural Network learning machine.\\r\\n\\r\\n\\t\\t\\t#grid.FCN(\\r\\n\\t\\t\\t\\tpath=\\\"/detectors.db\\\", \\r\\n\\t\\t\\t\\tdims=\\\"#{dims}\\\",page=\\\"#{page}\\\",\\r\\n\\t\\t\\t\\tcols=\\\"Name)\\\")\\r\\n\\r\\n\\t\\t\\t\\t:markdown\\r\\n\\t\\t\\t\\t\\tReserved for Fully Connected neural Network learning machine.\\r\\n\\r\\n\\t\\t\\t#grid.ANN(\\r\\n\\t\\t\\t\\tpath=\\\"/detectors.db\\\", \\r\\n\\t\\t\\t\\tdims=\\\"#{dims}\\\",page=\\\"#{page}\\\",\\r\\n\\t\\t\\t\\tcols=\\\"Name)\\\")\\r\\n\\r\\n\\t\\t\\t\\t:markdown\\r\\n\\t\\t\\t\\t\\tReserved for Attractor Neural Network learning machine.\\r\\n\\r\\n\\t\\t\\t#grid.GET(\\r\\n\\t\\t\\t\\tpath=\\\"/detectors.db\\\", \\r\\n\\t\\t\\t\\tdims=\\\"#{dims}\\\",page=\\\"#{page}\\\",\\r\\n\\t\\t\\t\\tcols=\\\"Name)\\\")\\r\\n\\r\\n\\t\\t\\t\\t:markdown\\r\\n\\t\\t\\t\\t\\tReserved for adhoc Good Edge to Track learning machine.\\r\\n\\r\\n\\t\\t\\t#grid.SOM(\\r\\n\\t\\t\\t\\tpath=\\\"/detectors.db\\\", \\r\\n\\t\\t\\t\\tdims=\\\"#{dims}\\\",page=\\\"#{page}\\\",\\r\\n\\t\\t\\t\\tcols=\\\"Name)\\\")\\r\\n\\r\\n\\t\\t\\t\\t:markdown\\r\\n\\t\\t\\t\\t\\tReserved for Self Organizing Map learning machine.\\r\\n\\r\\n\\t\\t\\t#grid.HMM(\\r\\n\\t\\t\\t\\tpath=\\\"/detectors.db\\\", \\r\\n\\t\\t\\t\\tdims=\\\"#{dims}\\\",page=\\\"#{page}\\\",\\r\\n\\t\\t\\t\\tcols=\\\"Name)\\\")\\r\\n\\r\\n\\t\\t\\t\\t:markdown\\r\\n\\t\\t\\t\\t\\tReserved for Hidden Markov Method learning machine.\\r\\n\\r\\n\\t\\t\\t#grid.ACE(\\r\\n\\t\\t\\t\\tpath=\\\"/detectors.db\\\", \\r\\n\\t\\t\\t\\tdims=\\\"#{dims}\\\",page=\\\"#{page}\\\",\\r\\n\\t\\t\\t\\tcols=\\\"Name)\\\")\\r\\n\\r\\n\\t\\t\\t\\t:markdown\\r\\n\\t\\t\\t\\t\\tReserved for an Adaptive Cosine Estimator learning machine.\\r\\n\\r\\n\\t\\t#folder.Jobs\\r\\n\\t\\t\\r\\n\\t\\t\\t:markdown\\r\\n\\t\\t\\t\\tThe job queue is automatically populated by [training, detection and user supervision \\r\\n\\t\\t\\t\\tjobs](/swag.view?goto=Jobs).  Feel free to Hawk over this queue to insure that\\r\\n\\t\\t\\t\\tyour jobs complete in the strategy/priority you design.  Try [liking SWAG](/likeus.view) \\r\\n\\t\\t\\t\\tto improve your job priority in these queues.\\r\\n\\t\\t\\t\\r\\n\\t\\t\\t#grid.Queue(\\r\\n\\t\\t\\t\\tpath=\\\"/queues.db\\\",\\r\\n\\t\\t\\t\\tdims=\\\"#{dims}\\\",page=\\\"#{page}\\\",refresh=60,\\r\\n\\t\\t\\t\\tcols=\\\"Flagged.c,Classif,Client,Class,Job,QoS.i,State.i,Work.n,Util(Util0.n,Util1.n,Util2.n,Util3.n),Arrived.d,Departed.d,RunTime.n,Not