INSERT INTO `engines` VALUES (45,0,1,'PY2','',0,'2014-10-27 02:09:58','{\n\"ports\": {\n\"S2\":{\"x\":10,\"y\":20},\n\"S3\":{\"x\":11,\"y\":21}\n}\n}','(U)','py','print \'PY2 running\'\n\ndef S2(tau,parm):\nprint tau,parm\nreturn 0\ndef S3(tau,parm):\nprint tau,parm\nreturn 0\n',0),(44,0,1,'PY1','',0,'2014-10-27 02:09:58','{\n\"ports\": {\n\"S1\":{\"x\":10,\"y\":20},\n\"S2\":{\"x\":11,\"y\":21}\n}\n}','(U)','py','print \'PY1 running\'\n\ndef S1(tau,parm):\n	print \"input\",tau,parm\n	return 0\ndef S2(tau,parm):\n	print \"output\",tau,parm\n	tau[0][\'x\'] = 123\n	return 0',0),(52,0,1,'SIM','',0,'2014-10-27 02:09:58','{ \"ports\": {\"fi\":{\"x\":10,\"y\":20},\"fo\":{\"x\":11,\"y\":21} } }','(U)','js','x =123;\n function fi(tau,parm) {\n  return 0;\n}; \n\nfunction fo(tau,parm) {\n  return 0;\n};',0),(127,0,1,'pydemo1','',0,'2015-01-08 02:30:39','','(U)','py','print \"welcome to python you lazy bird\"\nprint tau\nprint query\n\ntau = [ {\'x\':1, \'y\':2, \'z\':0}, {\'x\':3, \'y\':4, \'z\':10}]\n\nSQL0.execute(\"SELECT * from Htest\", () )\n\nfor (Rec) in SQL0:\n  print Rec\n',0),(159,0,1,'matdemo2','',0,NULL,'{\n\"entry\": {\n\"A\": \"SELECT a2,a3,a6 FROM app1.MATtest WHERE least(?,1)\",\n\"B\": \"SELECT a1,a6 FROM app1.MATtest WHERE least(?,1)\"\n},\n\n\"require\": {\n   \"addIt\" :  function (a,b) { return a+b; }\n}\n}','(U)','mat','Z = [1,2;3,4];\nX = A * A\';\nY = B * B\';\nR = addIt(1,3);',0),(132,0,1,'exdemo','',0,NULL,'','(U)','sh','ls\n\n',0),(151,0,0,'swag',NULL,0,'2015-12-09 20:47:20',NULL,'(U)','jade','//- UNCLASSIFIED\r\n//- SWAG dashboard\r\n\r\nextends site\r\nappend site.parms\r\n	- view = query.zone ? \"Nada\" : \"SWAG\"\r\n	- dock = \"left\"\r\n	- parms = {min:\"min\", all:\"all\"}\r\n	- dims = \"[1400,1000]\"\r\nappend site.body\r\n\r\n	if query.zone\r\n\r\n		#hold.Zones(path=\"/lookups.db?Ref=setpoint&enabled=1\",cols=\"Name,Path\",nomenu)\r\n\r\n		#border.SWAG(\r\n			title=\"#{query.zone} || #{client}\",crush,\r\n			head=\"Zones,Prefs(Locales,Themes,Edit),Files(View,Uploads,$uploads,Stores,$stores),LikeUs,Help\",\r\n			LikeUs=\"/likeus.db\",\r\n			View=\"/files.view\",\r\n			Edit=\"/edit.view?name=#{source}\")\r\n\r\n			:markdown\r\n				Set your **QoS-Cost comfort zone** here.  Visit [detector developers](\\swag.view) if you want\r\n				to fine-tune your detectors and your policies.  Please\r\n				[likeus](/likeus.view) to improve your QoS profile.  Other useful views:\r\n				[administrators](/admin.view), [security](/files.view), [machine learner developers](/engines.view),\r\n				[project scientist](/project.view), [proof editors](/files.view).\r\n\r\n			p $$ J_\\alpha(x) = \\sum\\limits_{m=0}^\\infty \\frac{(-1)^m}{m! \\, \\Gamma(m + \\alpha + 1)}{\\left({\\frac{x}{2}}\\right)}^{2 m + \\alpha} $$\r\n\r\n			:markdown\r\n				Dont forget to check-out the [geoNode home](/home.view) for other exciting **geoNode** products.			\r\n\r\n			#grid.Search(\r\n				path=\"/CATALOG.db\",center,crush,\r\n				head=\"Search,Execute,Print,Refresh\",\r\n				page=100,dims=\"#{dims}\",\r\n				search=\"Content\",\r\n				cols=\"Ref,Name,Link.h,Dated.d,Searched\")\r\n\r\n	else\r\n		#hold.Execute(path=\"/states.db?Class=Detector\",cols=\"Name,Name\")\r\n		#hold.Action(path=\"/states.db?Class=Action\",cols=\"Name,Name\")\r\n\r\n		//\r\n			#hold.PosCases(path=\"/positives.FILES.db\",cols=\"Name,File\")\r\n			#hold.NegCases(path=\"/negatives.FILES.db\",cols=\"Name,File\")\r\n\r\n		#folder.SWAG\r\n\r\n			:markdown\r\n				SWAG (Structerd Wide Area GEOINT) provides an R&D testbed (framework or environment) of\r\n				jpg-ready machine learners that semi-autonomously creates and operates a pool of \r\n				feature detectors matched to specific backgrounds.  In this way SWAG exploits NTM-commerical \r\n				EO imagery on its classified-unclassified systems to (1) estimate the performance of\r\n				future Chinese sensors incorporating its low-power machine learner, and (2) utilize its \r\n				high-power learners for indexing NTM imagery prior to long term archival.  \r\n\r\n				SWAG is architected to support NGA\'s SOM, OpenIT, Content Management goals and its \r\n				two main objectives support NGA\'s Future Sensor portfolio.\r\n				\r\n				SWAG is not an operational system; rather, SWAG seeks to suport operational systems\r\n				by providing a cloud compute testbed to evaluate machine learners.\r\n\r\n			#grid.News(\r\n				path=\"news.db\",\r\n				sorts=\"Stay,Starts\",page=30,dims=\"#{dims}\",calc,head=\"Search,Print,Refresh\",\r\n				cols=\"Message.h\")\r\n\r\n				:markdown\r\n					The rules governing the periodic roll-off and update of these news items can \r\n					be adjusted [here](/home.view?option=newsedit).\r\n\r\n			#fit.Conops\r\n			\r\n				:markdown\r\n					SWAG (Structerd Wide Area GEOINT) provides an R&D testbed (framework or environment) of\r\n					jpg-ready machine learners that semi-autonomously creates and operates a pool of \r\n					feature detectors matched to specific backgrounds.  In this way SWAG exploits NTM-commerical \r\n					EO imagery on its classified-unclassified systems to (1) estimate the performance of\r\n					future Chinese sensors incorporating its low-power machine learner, and (2) utilize its \r\n					high-power learners for indexing NTM imagery prior to long term archival.\r\n					\r\n					When SWAG happens over an area with known ground truth (e.g. when a BE is encounted in\r\n					the NTM channel), SWAG updates the ROC (false-alarm, hit-rate) score of all detectors\r\n					in the same focus area.  By retaining detector ROC curves, SWAG can intelligently boosting\r\n					the hypothesis from all detectors, thus creating a stronger detector from a pool of\r\n					weaker detectors.\r\n					\r\n					Define your Areas of Interest (by country, BE, sensor, etc) in the [AOI Filter](/swag.view?goto=AOI Filter),\r\n					then let the tipper deliver image chips over this AOI to [your detectors](/swag.view?goto=Detectors).\r\n					[Detection events](/swag.view?goto=Detections) can be consulted at any time.  The automatically populated\r\n					[training and detection jobs](/swag.view?goto=Jobs) can be managed by your job queue strategies/priorites.\r\n					Try [liking us](/likeus.view) to improve your priority in the job queues.\r\n					\r\n					Before you can attach a detector to an AOI, the detector will need to be trained.  If your detector (positive\r\n					feature over negative background) does not yet exists, clone or revise an existing detector, tune its\r\n					parameters, attach it to an AOI, then Execute (train) it to put it in the job queue.\r\n					\r\n					How are your detectors doing today?  Inpsect their [ROC performance](/swag.view?goto=ROC).\r\n					\r\n					Find an under-performing detector?  Begone with thee!  Simply go to [your detector](/swag.view?goto=Detectors)\r\n					and disconnect it from its AOI(s).  Or perhaps your feeling more kindly and would like to give\r\n					your detector a second chance?  Then, leave it connected, adjust more aggressive training parameters,\r\n					the Execute (train) it.  Most machine provide some form of \"transfer leaning\" and will thus continue\r\n					training your detector from its current state.\r\n					\r\n					Want to add a better machine learner?  Simply copy-and-paste your Python, Matlab-like, or \r\n					JS code (or bind your C code) into one of SWAG\'s [language agnostic engines](/engines.view).\r\n					Soon you will be able to use these engines in [workflows](/nodeflow.view) as well.\r\n					\r\n					Consult the [FAQs]() for additional Heilmier related thoughts.\r\n\r\n			#fit.Status.and.POCs\r\n				:markdown\r\n					Please note that SWAG is non-operational and thus enjoys no funding of any kind.  NGA/IIG thus\r\n					reserves the exclusive right to terminate SWAG at and time without notice.\r\n					\r\n					Project status can be found [here](http://jira.dev.ic.gov/jira/browse/GRD-1527) and \r\n					[here](http://jira.dev.ic.gov/jira/browse/GRD-1700) for the NTM and commerical systems, \r\n					respectively.\r\n					\r\n					For additional information, please contact:  \r\n					*	[Brian James](mailto://brian.d.james@nga.ic.gov) 811-1285  or [low-side](mailto://brian.d.james@nga.mil) 571-721-3589  \r\n					*	[Duncan McCharthy](mailto://duncan.l.mccharthy@nga.ic.gov) 578-6240  \r\n					*	[David Castor](mailto://david.m.castor@nga.ic.gov) TBD  \r\n					*	[Scott VanDusen](mailto://scott.w.vandusen@nga.ic.gov) TBD  \r\n					*	[Will King](mailto://william.t.king@nga.ic.gov) 811-1384  \r\n\r\n					NGA/IIG is developing a SWAG prototype under a JIRA projects GRD-1527,1700 with intent to deliver\r\n					a machine learning service assessable with the [GIAT R&D infrastructure](http://intellipedia.intelink.ic.gov/wiki/GIAT):\r\n					GEOHUB, C2S, ILE, and AWS are just four [ISPs](/requirements.view?goto=ISP) under\r\n					evaluation.  There are presently **NO** active plans to transition this technology\r\n					to an operational environment.\r\n\r\n			#tutorial.Briefing(dims=\"#{dims}\",refresh=\"1\")\r\n			\r\n			#fit.Disclaimers\r\n				:markdown\r\n					Please note that SWAG is non-operational and thus enjoys no funding of any kind.  NGA/IIG thus\r\n					reserves the exclusive right to terminate SWAG at and time without notice.\r\n			\r\n					NGA does not, under any circumstance, warrant, underwrite, endorse, promote or sell\r\n					any technologies used herein.  Use this service at your own risk.  Changes to \r\n					[SWAG\'s build-to requirements](/requirements.view) must be coordinated through\r\n					NGA IIG\'s [agile project management system](http://jira.dev.ic.gov/jira).  See\r\n					[SWAG\'s TTA/EULA](/requirements.view?goto=TTA) for additional technology \r\n					transfer and end-user agreement information.  SWAG welcomes your [issues, bugs, and \r\n					ideas](/issues.view).\r\n					\r\n			#fit.Architecture\r\n				:markdown\r\n					SWAG currently endores the OpenCV (low-power), Theano (high-power), and Caffe (high-power)\r\n					machine learning frameworks spanning low-high power compute clouds (w/o and w GPU support).\r\n\r\n					SWAG\'s classified (unclassified) systems ingests IDOPs tipped by HYDRA (Enhanced View),\r\n					then orthorectifed and chipped by OMAR (Enhanced View), then circulates jpgs to all \r\n					detectors sharing that area of interest.  Detectors -- those automatically built\r\n					by the machine learners -- return to SWAG a JSON-formatted detection event list.\r\n					\r\n					SWAG integrates mature chipping (e.g. OMAR, JPIP streaming, Digital Globe Enhanced View), \r\n					query (e.g. Hydra, DGEV) into mature [hyperthreaded workflows](/exsite.view?options=workflows)\r\n					running language agnostic (Python, Matlab-like, JS, or C) engines.\r\n\r\n					While SWAG has currently consumed the OpenCV machine learning framework -- low-power\r\n					learners built by the Russians for future Chinese millitary sensors -- SWAG has reserved\r\n					the Theano LeNet and Caffe engines for its high-power (GPU CUDA assisted) \r\n					learners.  SWAG also has interest in the Torch7 and OverFear learners.\r\n					\r\n					SWAG thus seeks to support a wide range of neural network machine learners including\r\n					decision, SVM and softmax capped convolutional, fully convolutional, attractor, and \r\n					self organizing neural networks to provide detection and symantic segmentation\r\n					of NTM-commerical images.\r\n					\r\n					Data mining and workflow management are key concepts utilized by SWAG.  Architected \r\n					around web-sockets, a JS-everywhere philosophy, and client-defined skins, SWAG \r\n					suppports the OpenIT and Content Management goals of many organizations.  Consult\r\n					the [Briefing](\\swag.view?goto=Briefing) for detailed architecture drawings.\r\n\r\n			#fit.FAQs\r\n\r\n			#fit.Configure\r\n				#form.Workflow.Parameters(\r\n					path=\"/config.db\",\r\n					dims=\"#{dims}\",crush,\r\n					head=\"Insert,Update,Delete,Select,Execute,Refresh,Restart\",Restart=\"/start.sys\",\r\n					cols=\"Hawks(SetPoint,MaxFaults.i,Hawks.c),Regulators(QoS0.n,QoS1.n,QoS2.n,QoS3.n,QoS4.n),Chip Cache(MaxAge.n),Services(WMS,WFS)\")\r\n\r\n				#grid.Forecasting.Models(\r\n					path=\"/models.db\",\r\n					dims=\"#{dims}\",crush,\r\n					head=\"Insert,Update,Delete,Select,Execute,Refresh,Restart\",Restart=\"/start.sys\",\r\n					cols=\"enabled.c,name,srcs.x,rots.x,sizes.x,flips.x,levels.x\")\r\n\r\n		#folder.Detectors\r\n		\r\n			:markdown\r\n				NGA does not, under any circumstance, warrant, underwrite, endorse, promote or sell\r\n				any technologies used herein.  Use this service at your own risk.  Changes to \r\n				[SWAG\'s build-to requirements](/requirements.view) must be coordinated through\r\n				NGA IIG\'s [agile project management system](http://jira.dev.ic.gov/jira).  See\r\n				[SWAG\'s TTA/EULA)(/requirements.view?goto=TTA) for additional technology \r\n				transfer and end-user agreement information.  SWAG welcomes your [issues, bugs, and \r\n				ideas](/issues.view).\r\n				\r\n			#grid.GMS(\r\n				path=\"/detectors.db\", \r\n				dims=\"#{dims}\",page=\"#{page}\",\r\n				cols=\"Enabled.c,Name,Execute.p,MaxDirty.n,Quality(Evaled.d,Dirty.n,Stars.n,Client),Proofs(PosCases.h,NegCases.h,Overhead.c),Sampling(Samples.i,ImageBg.i,ImageDev.i,Projections(xRotate.n,yRotate.n,zRotate.i)),Training(ROC(Data(MaxPos.i,MaxNeg.i),HAAR(Width.i,Height.i),MaxStages.i,MinTPR.n,MaxFPR.n),Tweak(MaxDepth.i,MaxWeak.i,TrimRate.n)),Detection(Channel,Pixels.i,Pack.i,Feature.n,Hits.i,SizeRange.n,SizeStep.n)\")\r\n\r\n				:markdown\r\n					This is the Godel Mathematical Society (HAAR neural network) learning machine.\r\n\r\n			#grid.CNN(\r\n				path=\"/detectors.db\", \r\n				dims=\"#{dims}\",page=\"#{page}\",\r\n				cols=\"Name\")\r\n\r\n				:markdown\r\n					Reserved for Convolutional Neural Network learning machine.\r\n\r\n			#grid.FCN(\r\n				path=\"/detectors.db\", \r\n				dims=\"#{dims}\",page=\"#{page}\",\r\n				cols=\"Name)\")\r\n\r\n				:markdown\r\n					Reserved for Fully Connected neural Network learning machine.\r\n\r\n			#grid.ANN(\r\n				path=\"/detectors.db\", \r\n				dims=\"#{dims}\",page=\"#{page}\",\r\n				cols=\"Name)\")\r\n\r\n				:markdown\r\n					Reserved for Attractor Neural Network learning machine.\r\n\r\n			#grid.GET(\r\n				path=\"/detectors.db\", \r\n				dims=\"#{dims}\",page=\"#{page}\",\r\n				cols=\"Name)\")\r\n\r\n				:markdown\r\n					Reserved for adhoc Good Edge to Track learning machine.\r\n\r\n			#grid.SOM(\r\n				path=\"/detectors.db\", \r\n				dims=\"#{dims}\",page=\"#{page}\",\r\n				cols=\"Name)\")\r\n\r\n				:markdown\r\n					Reserved for Self Organizing Map learning machine.\r\n\r\n			#grid.HMM(\r\n				path=\"/detectors.db\", \r\n				dims=\"#{dims}\",page=\"#{page}\",\r\n				cols=\"Name)\")\r\n\r\n				:markdown\r\n					Reserved for Hidden Markov Method learning machine.\r\n\r\n			#grid.ACE(\r\n				path=\"/detectors.db\", \r\n				dims=\"#{dims}\",page=\"#{page}\",\r\n				cols=\"Name)\")\r\n\r\n				:markdown\r\n					Reserved for an Adaptive Cosine Estimator learning machine.\r\n\r\n		#folder.Jobs\r\n		\r\n			:markdown\r\n				The job queue is automatically populated by [training, detection and user supervision \r\n				jobs](/swag.view?goto=Jobs).  Feel free to Hawk over this queue to insure that\r\n				your jobs complete in the strategy/priority you design.  Try [liking SWAG](/likeus.view) \r\n				to improve your job priority in these queues.\r\n			\r\n			#grid.Queue(\r\n				path=\"/queues.db\",\r\n				dims=\"#{dims}\",page=\"#{page}\",refresh=60,\r\n				cols=\"Flagged.c,Classif,Client,Class,Job,QoS.i,State.i,Work.n,Util(Util0.n,Util1.n,Util2.n,Util3.n),Arrived.d,Departed.d,RunTime.n,Notes.h\")\r\n\r\n			#grid.Hawk(\r\n				path=\"hawks.db\",\r\n				links=\"Table.queues\",\r\n				dims=\"#{dims}\",page=30,\r\n				cols=\"Rule(Name,Enabled.c,Condition.h,Action.p,Period.n,Status(Status.h,Changed.i,Matched.i,Pulse.i,Faults.i)\")\r\n\r\n				:markdown\r\n					Use these action-condition-table rules to hawk over your job queue with actions:\r\n					\r\n						stop=halt=kill to kill matched jobs and update its queuing history\r\n						remove=destroy=delete to kill matched jobs and obliterate its queuing history\r\n						log=notify=flag=tip to email owner a status of matched jobs\r\n						improve=promote to increase priority of matched jobs\r\n						reduce=demote to reduce priority of matached jobs\r\n						start=run to create jobs from dirty records\r\n						set expression to revise queuing history of matched jobs\r\n						\r\n			#accordion.Predictive.Look\r\n				#grid.Sim.Events(\r\n					path=\"/jobs.db\",\r\n					crush,\r\n					cols=\"label,job,tDepart.n,tArrive.n,tWait.n,tDelay.n,tService.n,tStep.n,depth.i\")\r\n					\r\n				#plot.QoS.Stats(\r\n					path=\"jobstats.db&index=delay,pr&init=0,0&ref=[0,0],[100,1]&marker=dot\",refresh=\"1\",\r\n					dims=\"#{dims}\")\r\n\r\n		#accordion.Detects(head=\"none\")\r\n		\r\n			#pivot.Events(\r\n				path=\"rocs.db\",\r\n				dims=\"#{dims}\",page=\"#{page}\",\r\n				pivots=\"Name\",head=\"Search,Print,Execute\",\r\n				cols=\"detector,channel\")\r\n\r\n				:markdown\r\n					Define your Areas of Interest (by country, BE, sensor, etc) in the [AOI Filter](/swag.view?goto=AOI Filter),\r\n					then let the tipper deliver image chips over this AOI to [your detectors](/swag.view?goto=Detectors).\r\n					[Detection events](/swag.view?goto=Detections) can be consulted at any time.\r\n		\r\n			#folder.Visuals(dock=\"top\")\r\n				#post.Tip.Sheet(path=\"tipsheet.view?src=tips.db&pivots=channel,chip,links,label,count,Stars\",dims=\"#{dims}\")\r\n\r\n				#map.Tip.Map(\r\n					path=\"/maps.db&fill=Type&index=Name&details=Info\",\r\n					dims=\"#{dims}\",refresh=\"#{hold}\",links=\"Browser\")\r\n\r\n				#force.Pivot1(\r\n					path=\"/tips.db&pivots=channel,chip,label,count,Stars\",\r\n					dims=\"#{dims}\",refresh=\"1\",links=\"Events\")\r\n					\r\n				#cluster.Pivot2(\r\n					path=\"/tips.db&pivots=channel,chip,label,count,Stars\",\r\n					dims=\"#{dims}\",refresh=\"1\",links=\"Events\")\r\n					\r\n				#treefan.Pivot3(\r\n					path=\"/tips.db&pivots=channel,chip,label,count,Stars\",\r\n					dims=\"#{dims}\",refresh=\"1\",links=\"Events\")\r\n\r\n				#treemap.Pivot4(\r\n					path=\"/tips.db&pivots=channel,chip,label,count,Stars\",\r\n					dims=\"#{dims}\",refresh=\"1\",links=\"Events\")\r\n\r\n				#plot.ROC(\r\n					path=\"/rocs.db&index=FPR,TPR,model&_ref=[0,0],[1,1]&_min=0,0&max=1,1&marker=dot&legend=basic,hard,challenge&trace=1&_extra=[0,0]\",\r\n					dims=\"#{dims}\",refresh=\"1\",links=\"Events\")\r\n\r\n		#folder.AOIs\r\n		\r\n			:markdown\r\n				Define your Areas of Interest (by country, BE, sensor, etc) in the [Tipper](/swag.view?goto=AOIs),\r\n				then let the tipper deliver image chips over this AOI to [your detectors](/swag.view?goto=Detectors).\r\n				[Detection events](/swag.view?goto=Detections) can be consulted at any time.  AOIs can\r\n				be connected to detectors (trained or not) at any time.  If you need multiple AOIs attached to a detector, \r\n				simply clone (select-insert) the detector and attach to the AOI.\r\n				\r\n			#post.Tipper(path=\"https://hydra.ilabs.ic.gov\",dims=\"[750,500]\")\r\n\r\n			#grid.Override(\r\n				path=\"tests.db\",\r\n				dims=\"#{dims}\",page=\"#{page}\",\r\n				cols=\"Name,Channel,FilePath\")\r\n\r\n		#nodeflow.Flows(path=\"&view=Kiss\",dims=\"#{dims}\",refresh=\"1\")\r\n\r\n//- UNCLASSIFIED\r\n',0),(161,0,1,'jsdemo2','',0,NULL,'{\n\"M\": 3, \"query\": {\"Name\": \"test\"} ,\n\"entry\": {\n\"X\": \"SELECT p0,p1,p2 FROM app1.Htest WHERE least(?,1)\",\n\"y\": \"SELECT FPR from app1.Htest WHERE least(?,1)\"\n}\n}','(U)','js','var scope = {X:X, y:y};\nvar N = X.length;\n\nMATH.eval(\"a = inv(X\' * X) * X\' * y\",scope);\nCON.log(scope.a);\n\nvar b = {Name: query.Name, Tests:N, Computed:new Date()}, a=scope.a;\nfor (var n=0,N=a.length;n<N;n++) b[n] = a[n];\n\nCON.log(b);\n',0),(160,0,1,'jsdemo1','',0,NULL,'{\"M\":3, \"query\": {\"Name\" : \"test\"},\n\"entry\": {\n\"A\": \"SELECT a2,a3,a6 FROM app1.MATtest WHERE least(?,1)\",\n\"B\": \"SELECT a1,a6 FROM app1.MATtest WHERE least(?,1)\"\n}}','(U)','js','CON.log(\"M = \"+M+\" Name=\"+query.Name);\nCON.log(\"A=\"+A.length+\" by \"+A[0].length);\nCON.log(\"B=\"+B.length+\" by \"+B[0].length);\ntau = [ {u: M}, {u:M+1}, {u:M+2} ];  ',0),(162,0,1,'pydemo2','',0,NULL,'{ \"ports\" : { \"f1\": {\"a\":1, \"b\":2}, \"f2\": {\"a\":2,\"b\":1} } }','(U)','py','print \"executing on port \" + port\n\ndef f1(tau,parm):\nprint \"in port f1\"\nreturn 0\n\ndef f2(tau,parm):\nprint \"in port f2\"\nreturn 0\n',0),(163,0,1,'matdemo1','',0,NULL,'{\n\"entry\": {\n\"A\": \"SELECT a2,a3,a6 FROM MATtest WHERE least(?,1)\",\n\"B\": \"SELECT a1,a6 FROM MATtest WHERE least(?,1)\"\n}}','(U)','mat','Z = [1,2;3,4];\nX = A * A\';\nY = B * B\';',0),(158,0,1,'sqldemo','',0,NULL,'','(U)','sql','SQL.select = function (sql,recs,cb) {\nvar q = sql.query(\"SELECT * FROM ?? WHERE ?\",[\"intake\",{TRL:2}])\n.on(\"result\", function (rec) {\nrec.Cat = rec.Name + rec.Tech;\nrecs.push(rec);\n})\n.on(\"end\", function () {\nCON.log(\"returning recs=\"+recs.length);\ncb(recs);\n});\nCON.log(\"sql command=\"+q.sql);\n}\n',0),(181,0,0,'files',NULL,0,NULL,NULL,'(U)','jade','//- UNCLASSIFIED\n\nextends site\nappend siteparms\n- view = \"Min\"\nappend sitearea\n\n#grid.Files(path=\"/FILES.db\",\npatg=\"#{page}\",dims=\"#{dims}\",typical,dock=\"top\",\ncols=\"Ref,Link.h,Area,Name,Size,Tags,Tagger\")\n\n#minielt.ELT(links=\"src.Files.Ref\")\n',0),(182,0,0,'tutorial',NULL,0,NULL,NULL,'(U)','jade','//- UNCLASSIFIED\r\n//- Provides a tutorial for the integrate at level more=0,1\r\n\r\nextends brief\r\nappend briefparms\r\n- Classif = \"(U) Unclassified\"\r\n- Home = \"#cm.links\"\r\nappend briefarea\r\n\r\nsection\r\n\r\nsection#hello\r\n\r\np.lg Welcome\r\n\r\nsection#topics\r\nh4.hd World Views\r\n\r\ntable\r\ntr: th: a(href=\"#ifs\") Interfaces\r\ntr: th: a(href=\"#cm\") Content Management\r\ntr: th: a(href=\"#arch\") Architecture\r\ntr: th: a(href=\"#swag\") Application\r\n\r\nsection#ifs\r\nh4.hd Many Interfaces\r\ntable\r\ntr\r\nth: a(href=\"/api.view\") API\r\nth: a(href=\"/skinguide.view\") Skinning\r\nth: a(href=\"/files.view\") Files\r\ntr\r\nth: a(href=\"/tutorial.view\") Tutorial\r\nth: a(href=\"/engines.view\") Engines\r\nth: a(href=\"/workflow.view\") Workflows\r\ntr\r\nth: a(href=\"/issues.view\") Issues\r\nth: a(href=\"/requirements.view?goto=ASP Reqts\") Requirements\r\nth: a(href=\"/requirements.view?goto=Roadmap\") Roadmap\r\ntr\r\nth: a(href=\"/swag.view\") SWAG \r\nth: a(href=\"/workflow.view\") Workflows\r\nth\r\na(href=\"/files.view\") Positives\r\na(href=\"/files.view\") Negatives\r\n\r\nsection#cm\r\nh4.hd Content Management - Wiki on Steriods\r\n\r\nsection#cm.links\r\nh3.hd Example Jade Skins\r\ntable\r\ntr\r\ntd: a(href=\"#cm.briefs\") Briefings\r\ntd: a(href=\"#cm.blogs\") Blogs\r\ntr\r\ntd: a(href=\"#cm.finders\") Finders\r\ntd: a(href=\"#cm.nav\") Navigators\r\ntr\r\ntd: a(href=\"#cm.engines\") Engines\r\ntd: a(href=\"#cm.workflows\") Workflows\r\ntr\r\ntd: a(href=\"#cm.inline\") Inline\r\ntd: a(href=\"#cm.papers\") Sourced\r\ntr\r\ntd: a(href=\"#cm.immersive\") Immersive\r\ntd: a(href=\"#cm.analytics\") Analytics\r\n\r\n\r\nsection#cm.briefs\r\nh3.hd Briefing Skins via Jade Engine\r\npre\r\ncode.mysql.\r\nextends brief\r\nappend briefparms\r\n- Classif = \"(U) Unclassified\"\r\nappend briefarea\r\n\r\nsection#cm\r\nh4.hd Content Mgt\r\n\r\nsection#cm.engines\r\nh4.hd Engines: Interface or End Points\r\niframe(src=\"/exsite.view?option=engines&view=Kiss&hold=1\")\r\n\r\netc\r\netc\r\n\r\nsection#cm.nav\r\nh3.hd Navigation Skins via Jade Engine\r\niframe(src=\"/exsite.view?option=navigators&view=Nada&hold=1\")\r\n\r\nsection#cm.engines\r\nh3.hd Engines: Skin or End Point\r\niframe(src=\"/exsite.view?option=engines&view=Kiss&hold=1\")\r\n\r\nsection#cm.workflows\r\nh3.hd Engines in Stateless/Stateful Workflows\r\niframe(src=\"/exsite.view?option=workflows&view=Kiss&hold=1\")\r\n\r\nsection#cm.inline\r\nh3.hd Mathjax Skins via Jade Engine\r\ntable\r\ntr\r\npre\r\ncode.html.\r\np.al The Lorenz Equations\r\np.\r\n\\[\r\n\\begin{align}\r\n\\dot{x} & = \\sigma(y-x) \\\\\r\n\\dot{y} & = \\rho x - y - xz \\\\\r\n\\dot{z} & = -\\beta z + xy\r\n\\end{align}\r\n\\]\r\nbr\r\np.al.lg.rd Impressive \'eh\r\np.\r\n\\[\r\nJ_\\alpha(x) = \\sum\\limits_{m=0}^\\infty \\frac{(-1)^m}{m! \\, \\Gamma(m + \\alpha + 1)}{\\left({\\frac{x}{2}}\\right)}^{2 m + \\alpha}\r\n\\]\r\n\r\ntr\r\np.al The Lorenz Equations\r\np.\r\n\\[\r\n\\begin{align}\r\n\\dot{x} & = \\sigma(y-x) \\\\\r\n\\dot{y} & = \\rho x - y - xz \\\\\r\n\\dot{z} & = -\\beta z + xy\r\n\\end{align}\r\n\\]\r\nbr\r\np.al.lg.rd Impressive \'eh\r\np.\r\n\\[\r\nJ_\\alpha(x) = \\sum\\limits_{m=0}^\\infty \\frac{(-1)^m}{m! \\, \\Gamma(m + \\alpha + 1)}{\\left({\\frac{x}{2}}\\right)}^{2 m + \\alpha}\r\n\\]\r\n\r\nsection#cm.immersive\r\nh3.hd Gaming Skins\r\nimg(src=\"/shares.Jade.ico\")\r\nimg(src=\"/shares.construction.jpg\",width=\"20px\",height=\"20px\")\r\n\r\niframe(src=\"/exsite.view?option=immersion&view=Nada&hold=1\")\r\n\r\nsection#cm.blogs\r\nh3.hd Blogging Skins can be printed\r\niframe(src=\"/exsite.view?option=blogs&view=Nada&hold=1\")\r\n\r\nsection#cm.papers\r\nh3.hd MathJax Skins via Jade Engine\r\niframe(src=\"/exsite.view?option=papers&view=Nada&hold=1\")\r\n\r\nsection#cm.finders\r\nh3.hd Data Finding Skins via Jade Engine\r\niframe(src=\"/exsite.view?option=finders&view=Nada&hold=1\")\r\n\r\nsection#cm.analytics\r\nh3.hd Data Analytic Skins via Jade Engine\r\niframe(src=\"/exsite.view?option=visuals&view=Nada&hold=1\")\r\n\r\nsection\r\nh4.hd Story\r\n\r\nsection\r\nh3.hd SOM, Content Mgt, Data Strategy, Immersion\r\niframe(src=\"/embed.view?src=shares.arch1.jpg&w=400&h=400\")\r\nsection \r\nh3.hd Less is More\r\niframe(src=\"/embed.view?src=shares.arch2.jpg&w=400&h=400\")\r\nsection \r\nh3.hd A World View\r\ntable.ac\r\ntd\r\np.lg.fragment.fade-out $ Users stay with the ALG - not in the testbed\r\np.lg.fragment.fade-out $ Cloud enabled - ALG external to testbed\r\np.lg.fragment.fade-out $ Users own the ALG\r\np.lg.fragment.fade-out $ Testbed is a WEB Service\r\np.lg.fragment.fade-out .... Instantly executes new ALG config reqts\r\np.lg.fragment.fade-out .... Situational awareness by all users\r\ntd: img(src=\"/shares.car_repair.jpg\",width=800,height=600)\r\n\r\naside.notes\r\ncode.\r\nThe goal here is to separate the UUT (the GEOINT algorithms) from the testbed.\r\nWe are propsing todo this by requiring GEOINT developers to PKI-enable their\r\ncode.!  Simply go to FSGALAM web site and request and download PKI key-pair.\r\nDeveloper responsbile for holding configuration in the ALG itself - not the\r\nNGA testbed!  If absoluting needed, ALG may retrieve config from NGA testbed \r\nwhen commanded - this acks developers approval that config is held in NGA testbed.\r\n\r\nsection\r\nh3 test\r\nsection \r\nh4 System View\r\nimg(src=\"/shares.FSGALAM_system.jpg\",width=1200,height=600)\r\nsection \r\nh4 Ingest View\r\nimg(src=\"/shares.FSGALAM_ingest.jpg\",width=1200,height=600)\r\nsection \r\nh4 Egress View\r\nimg(src=\"/shares.FSGALAM_egress.jpg\",width=1200,height=600)\r\n\r\nsection\r\nh3 Methodology\r\n\r\nsection\r\nh4 Technology\r\nimg(src=\"/shares.m1.jpg\",width=1200,height=600)\r\nsection\r\nh4 Portfollio\r\nimg(src=\"/shares.m2.jpg\",width=1200,height=600)\r\nsection\r\nh4 Project\r\nimg(src=\"/shares.m3.jpg\",width=1200,height=600)\r\nsection\r\nh4 ISP Compliance\r\nimg(src=\"/shares.m4.jpg\",width=1200,height=600)\r\n\r\nsection\r\nh3 What do Algorithms Require?\r\n\r\ntable.ac\r\ntr\r\ntd: p.lg.al Ambiguous in the english language\r\ntd: p.lg.al To drive or to consume?\r\ntr\r\ntd: p.lg.al \"Customer\" owns the requirements\r\ntd: p.lg.al \"Supplier\" owns the configurations\r\ntr\r\ntd: p.lg.al Always difficult to verify\r\ntd: p.lg.al Non-requirements futile\r\ntr\r\ntd.bl: p.lg _\r\ntd.bl: p.lg _\r\ntr\r\ntd: p.lg.al verifiable (Inspect, Demo, Analysis, Test)\r\ntd: p.lg.al Parameter View\r\ntr\r\ntd: p.lg.al read/write accessible <strong>at all times by all parties</strong>\r\ntd: p.lg.al non-blocking, situational awareness\r\ntr\r\ntd: p.lg.al expressible in a common language (fortran, xml, ...)\r\ntd: p.lg.al markdown language\r\ntr\r\ntd: p.lg.al change tracked (no anonymity)\r\ntd: p.lg.al PKI\r\ntr\r\ntd: p.lg.al scorable at all times by all parties (p/f, 1-5)\r\ntd: p.lg.al Evaluation View\r\ntr\r\ntd: p.lg.al tracable to next level of assemblies\r\ntd: p.lg.al opendb enable for OO/MS apps\r\n\r\nsection#arch\r\nh4.hd Architecture\r\nsection\r\na(href=\"https://-github.com/visionmedia/jade#readme\") Jade\r\na(href=\"http://-nodejs.org/\") NodeJS\r\na(href=\"http://-www.sencha.com/products/extjs/examples/\") ExtJS\r\na(href=\"https://-github.com/LearnBoost/socket.io/wiki/Configuring-Socket.IO\") Socket.io\r\na(href=\"http://-d3js.org/\") D^3\r\nsection\r\nimg(src=\"/shares.architecture.jpg\",width=600,height=500)\r\nsection\r\nimg(src=\"/shares.techstack.jpg\",width=600,height=500)\r\n\r\n//- UNCLASSIFIED\r\n',0),(198,0,0,'roles',NULL,0,'2015-12-09 01:15:21',NULL,'','select','undefined',0),(200,0,0,'chips',NULL,0,'2015-12-09 01:24:06',NULL,'','execute','function (req, cb) {   // reserved to flush old/bad chips\r\n	var ses = req.ses, sql = ses.sql, log = ses.log, query = req.query;\r\n	cb(\"reserved\");\r\n	\r\n	for (var n=0,N=1e5;n<N;n++) {\r\n		var x = [Math.random(),Math.random(),Math.random(),Math.random()],\r\n			y = [Math.random(),Math.random(),Math.random(),Math.random()];\r\n			\r\n		sql.query(\r\n			\"INSERT INTO chips SET ?,address=geomfromtext(?)\", [\r\n			{ name: \"bogus\" }, \r\n			\'POLYGON((\' + [\r\n				[x[0],y[0]].join(\" \"),\r\n				[x[1],y[1]].join(\" \"),\r\n				[x[2],y[2]].join(\" \"),\r\n				[x[3],y[3]].join(\" \"),\r\n				[x[0],y[0]].join(\" \") ].join(\",\")\r\n				+\'))\'\r\n			]);\r\n	}\r\n				\r\n}',0),(202,0,0,'home',NULL,0,'2016-05