INSERT INTO `skins` VALUES (51,'// UNCLASSIFIED\r\n// Level-3 skin provides a Skinning Guide.\r\n//\r\n// Skinning guide: [URL]/skin.view\r\n// API guide: [URL]/icd.view\r\n// Parameters: [URL]/parms.view\r\n// Skins mapdrive: [URL]/skins\r\n// Theme mapdrive: [URL]/css\r\n\r\nextends site\r\nappend siteparms\r\n	view = \"Skinning Guide\"\r\nappend sitearea\r\n\r\n	#fit.Introduction\r\n\r\n		:markdown\r\n			Information to and from the #{title} is rendered using the [Jade](https://github.com/visionmedia/jade/blob/master/Readme.md) \r\n			markdown engine.  Markdown in a `Jade File` (like `myskin.view`) renders data from site to client, \r\n			whereas markdown in a `Jade Field` (like `myblog` in a sql table) renders data to site from client.\r\n			Jade markdown always contains a preamble to specify the required resources.\r\n		br\r\n		:markdown\r\n			## Jade File Preamble\r\n			>		extends layout\r\n			>		append support\r\n			>			Layout = LAYOUT\r\n			>			Features = FEATURES\r\n			>		append layoutarea\r\n		:markdown\r\n			where `LAYOUT` is either \"Grid\", \"Typeset\", \"Guides\", ^ \"Mobile\", \"Model\", \"Voxel\", \"Sceen\", \"Three\",\r\n			^ \"Cesium\", \"Grid\", or ^ \"Applet\" (^ experimental), and where `FEATURES` = {feature:1,\r\n			feature:1,...} enables the desired features specfic to this LAYOUT. In addition to the `layout` framework,\r\n			there are `site`, `doc`, and `brief` frameworks.  {Need to list the features}.  \r\n		br\r\n		:markdown\r\n			## Jade Field Preamble\r\n			>		//EQMRDB;title;ver;date;by;contact\r\n		:markdown\r\n			where {need to fix this info} the `resouce switches` define the desired layers for this skin:  \r\n			+	[sql data (ExtJS=1 or //E)](http://www.sencha.com/products/extjs/),  \r\n			+	[free text (jQuery=1 or //Q)](http://jquery.com/),  \r\n			+	[equations (MathJax=1 or //M)](http://www.mathjax.org/),  \r\n			+	[slides (Reveal=1 or //R)](http://lab.hakim.se/reveal-js/), or  \r\n			+	[graphics (D3=1 or //D)](http://d3js.org/) over the  \r\n			+	[foundation (Basic=1 or //B)](https://github.com/visionmedia/jade/blob/master/Readme.md) --  \r\n			+	[(Markdown)](http://daringfireball.net/projects/markdown/syntax) layers.\r\n		:markdown\r\n			If no `resouce switches` are provided, only the foundation layer is resourced.	Observe that\r\n			indentation in a `Jade File` is **one level deeper** than in a `Jade Field`.\r\n\r\n	#post.Example.Sites(path=\"/exsite.view\",dims=\"[800,500]\")\r\n\r\n	#folder.Skinning.Guide(dock=\"left\")\r\n			\r\n		#fit.Widget.Layout\r\n			:markdown\r\n				The general layout of a Jade markdown is illustrated below, where `[preamble]` is the preamble\r\n				suitable for a `Jade File` or `Jade Field`.  Here, `HtmlTag` means any HTML tag following the Jade syntax,\r\n				and `ishtml` starts a component-free HTML block.  \r\n				>\r\n				>	[preamble]\r\n				>		#Widget.Name(Attributes)\r\n				>			#Widget.Name(Attributes)\r\n				>			#Widget.Name(Attributes)\r\n				>			:\r\n				>			#Widget.Name(Attributes)\r\n				>				#Widget.Name(Attributes)\r\n				>				#Widget.Name(Attributes)\r\n				>				:\r\n				>			#Widget.Name(Attributes)\r\n				>				:\r\n				>		#Widget.Name(Attributes)\r\n				>				:\r\n				>		\r\n				>		tag(attribute=value,...)\r\n				>			inner html for tag\r\n				>\r\n				>		ishtml \r\n				>			content containing only HtmlTags (no components)  \r\n				where a `Widget` is one of the following:  \r\n\r\n				* 		container: `folder`,`accordion`,`table`,`column`,`border`,`window`\r\n				* 		layout: `anchor`,`fit`,`hbox`,`vbox`,`box`,`post`\r\n				* 		terminal: `grid`,`form`,`gauge`,`bar`,`pivot`,`find`\r\n				* 		store: NameOfStore\r\n\r\n		#fit.Source.Attributes\r\n			:markdown\r\n				> 	path 	= data path \"/table.db?parms\", [inline data], {inline parms}, or 0\r\n				> 	class 	= unique name for this data descriptor\r\n				> 	links	= link data \"Slave.Table.Master, Slave.Value, Table, ...\"\r\n				> 	key	= unique id field (default is \"ID\")\r\n				> 	sync 	= synchronously load the data \r\n				>	selects = field generators \"expression AS field, ...\"\r\n				>	index	= field indicies \"field, ...\"  \r\n		#fit.Column.Attributes\r\n			:markdown\r\n				> 	cols	= ungrouped fields \"field.type.label.summary.tip, field*, field*count, ...\"\r\n				> 	cols	= grouped fields \"group(field,group(field, ...), ...), ...\"\r\n				> 	cols	= pivoted fields \"Lock(GroupID,GroupCount,field, ...), ...\"\r\n				> 	cols	= node fields \"Lock(ParentID,field, ...), ...\"\r\n				> 	cols	= locked fields \"Lock(field, ...), ...\"\r\n				>	pivots 	= pivot shortcut \"field,field,...\" \r\n				>	nodes	= node shortcut \"field,field,...\" \r\n				>	locks	= lock shortcut \"field,field,...\"   \r\n		#fit.Field.Attributes\r\n			:markdown\r\n				>	summary	summarize name by min,max,sum,average\r\n				>	name*		match parms DD fields \"field0, field1, ...\"\r\n				>	name*count	match parms DD fields \"field0, field1, ... name[count-1]\"\r\n				>	label	label name for field\r\n				>	type	field data type (caps imply disable editing)\r\n				>	basic	int, autonum, checkbox, boolean, text, html, file, $, %, number, svg, xtextarea, empty\r\n				>	date	date, mediumdate, defaultdate, iso8601long, iso8601short,shortdate, longdate, fulldatetime, monthday, shorttime, longtime, sortabledatetime, universalsortabledatetime, yearmonth\r\n				>	pulldown	p DataTable : ValueField : DisplayField : ... \r\n				>	multidown	m DataTable : ValueField : DisplayField : ... \r\n				>	queuedown	q DataTable : ValueField : DisplayField : ... \r\n				>	action	##...	icon link to icons/fieldValue[0, 1, ...]\r\n				>	action	#a	file link to link/fieldValue\r\n				>	action	#i	image link to link/fieldValue  \r\n			\r\n		#fit.Client.Attributes\r\n			:markdown\r\n				>	guard	= password guard for this client\r\n				>	icons	= path to icon resources for this client\r\n		\r\n		#fit.Presentation.Attributes\r\n			:markdown\r\n				>	dims	= \"[width, height]\" maximum dimensions\r\n				>	sorts	= \"field, field, ...\" sort fields\r\n				>	title	= \"<=>$X...\" header align (<)left,(=)center,(>)right with $N name,$P path,$S links\r\n				>	help 	= \"content\" help content\r\n				>	page	= N number of records allowed in data store \r\n				>	plot	= \"bar,column,scatter,info,pie,radar,xgrid,ygrid,[xmin,xmax,ymin,ymax]\"\r\n				>	dock	= \"top,bottom,left,right\" folder docking\r\n				>	region	=  \"north,south,east,west,center\" region specification\r\n				>	track	= \"M,U\" track client as (M)moderator, (U)nonmoderator, or \"\" to disable\r\n		\r\n		#fit.Presentation.Switches\r\n			:markdown\r\n				>	actions	enable CRUD actions and CRUD status buttons\r\n				>	filter 	enable grid field filters\r\n				>	summary include column aggregates\r\n				>	resize	include resizing handles\r\n				>	crush	include grid collapse button\r\n				>	refresh	include grid refresh button\r\n				>	hide	hide this component\r\n				>	wrap	expose headers and buttons of subcomponents (required for #post in #accordion)\r\n				>	disable to disable this component\r\n				>	guard	to forbid content editing\r\n				>	hold	hold view state (experimental)\r\n				>	kiss	keep header names simple when linking\r\n				>	make	make table if it does not already exists\r\n			\r\n		#fit.Menus.Attributes\r\n			:markdown\r\n				>	menu	= \"name([proxy],[combo],[special], ...)\"\r\n				>  \r\n				>	[combo] = \"/component,field,field,...\" combobox from component store\r\n				>	[proxy]	= \"/url/&X=?a&Y=?b\" proxy path after ?field replacements\r\n				>	[special] = Send,Open,TipMe,Users,Themes,Skins,Queues,Engines,Search,Uploads,Stores,$stores,$uploads\r\n				> \r\n				> 	$area	= file uploader into file area \r\n				>\r\n				>	create	= \"Name\" or \"Name/Path/Query\" feeds widget Name after Query ?field-replacements\r\n				>	select	= \"Name\" or \"Name/Path/Query\" feeds widget Name after Query ?field-replacements\r\n				>	update	= \"Name\" or \"Name/Path/Query\" feeds widget Name after Query ?field-replacements\r\n				>	delete	= \"Name\" or \"Name/Path/Query\" feeds widget Name after Query ?field-replacements\r\n			\r\n		#fit.Simulation.Model.Attributes\r\n			:markdown\r\n				## triggered system:\r\n				>	inputs	= \"port, port, ...\" are the source ports for a triggered system\r\n				> 	outputs = \"port, port, ...\" are the target ports for triggered system \r\n				where port = \"tap | tap | ...\" are the taps by which to link the triggered system\r\n				## state machines:\r\n				>	routes	= \"route, route, ...\" are the routes for a state machine \r\n				where route = \"fromState | toState | condition | exit | entry\" defines from-to machine states, condition code and from state exit-entry code (condition=start to define initial state).\r\n				## petri nets:\r\n				>	markers	= \"transition, transition, ...\" are the transitions for a petri net\r\n				where\r\n				> 	transition = \"fromPlaces || transition || toPlaces\" defines from-to places and transition to take-deposit petri net tokens (\"n|k|...\" initializes each place with n,k,... tokens).\r\n				> 	places = \"place | place | ...\" are the places from which to take-deposit petri net tokens.\r\n				> 	stats	= name of simulation options set in /simoptions.db (\"\" to disable)\r\n				> 	start	= name of component to open (default is \"content\")\r\n\r\n	#fit.Jade.Variables\r\n		:markdown\r\n			The server provides the following client variables when referenced\r\n			by `\\#{var}` or `\\!{var}` within a jade skin (current value or \"N/A\"\r\n			if not applicable):\r\n			> 	IP	client\'s IP address (#{IP})\r\n			> 	location client\'s location (#{location})\r\n			> 	org	client\'s PKI organization (#{org})\r\n			> 	email	client\'s email address (#{email})\r\n			> 	user	client\'s user ID (#{user})\r\n			> 	joined	session start time (#{joined})\r\n			>	query	query hash (#{query})\r\n			>	server	site URL (#{server})\r\n			> 	contact	site contact (#{contact})\r\n			> 	server	path to site (#{server})\r\n			> 	by	site credit (#{by})\r\n			> 	title	site name (#{title})\r\n			>	sql	hash to current SQL connection\r\n			>	action	current SQL action (#{action})\r\n			>	source	current SQL table, target, source, view (#{source})\r\n			>	journal transaction journalling enabled (#{journal})\r\n			> 	thread	method to start SQL thread (N/A)\r\n			> 	session	method to start SQL session (N/A)\r\n			> 	close	method to release SQL session (N/A)\r\n			> 	ver	site full version number View.Icon.Fix (#{ver})\r\n			> 	icons	path to icon resources (#{icons})\r\n			> 	images	path to image resources (#{images})\r\n			> 	themes	path to css themeing resources (#{themes})\r\n			> 	date	site release date (#{date})\r\n			> 	sockets	URL to socket.io (#{sockets})				\r\n			> 	type	Client type M=moderator, U=nonmoderator (#{type})\r\n			> 	moderator moderator contact (#{moderator})\r\n','skin','default',0),(52,'//- UNCLASSIFIED\r\n//-\r\n	Provides example sites given query:\r\n		ex = [odbc,games,grids,guides,typesets,briefs,models,charts] desired site view\r\n\r\nextends site\r\nappend siteparms\r\n	- view = query.ex + \" Example Site\"\r\n	- parms = {odbc:\"ex=odbc\", immersion:\"ex=immersion\", grids:\"ex=grids\", guides:\"ex=guides\", typesets:\"ex=typesets\", brief:\"ex=briefs\", models:\"ex=models\", charts:\"ex=charts\"}\r\nappend sitearea\r\n\r\n	case query.ex\r\n		when \"odbc\"\r\n			#grid.Excel(path=\"/test.db\",cols=\"a,b,c,d\")\r\n			#grid.ViaAccess(path=\"/linktest.db\",cols=\"a,b,c,d,e\")\r\n			#grid.WebSite(path=\"/somesite.db\",cols=\"x1,x2,x3,x4\")\r\n			#grid.Text\r\n			#grid.YQL\r\n			#grid.RSS\r\n			#grid.Proxies(path=\"/proxies.db\",actions,\r\n				cols=\"Enabled.c,Name,File(Path,Sheet),Period.n,Special.x,Updates.i,Updated.d,Machine(Vars.x,Classif,Engine,Code.x)\")\r\n			\r\n		when \"immersion\"\r\n			#folder.Gaming(dock=\"left\")\r\n				#post.Blast(path=\"/cubeland.view\",dims=\"#{dims}\")\r\n				#post.Bounce(path=\"/spherebounce.view\",dims=\"#{dims}\")\r\n				#post.Anagylph(path=\"/anaglyph.view\",dims=\"#{dims}\")\r\n				#post.Build(path=\"/voxelpaint.view\",dims=\"#{dims}\")\r\n\r\n		when \"grids\"\r\n			#post.Welcome(path=\"/bigwelcome.view\",dims=\"[750,500]\")\r\n			#pivot.Find(\r\n				path=\"/intake.db\",\r\n				page=10,dims=\"#{dims}\",check,help,track=\"#{type}\",search,hold,refresh,\r\n				pivots=\"Bogus,App,Name,Tech\",actions,kiss,\r\n				cols=\"Test,Condition(TRL,Track,Reason),General(Special,HWConfig,SWConfig,Parms),Data Collect Requirements(Reqts(C*),iName,iClassif,iSpec),Host Env Requirements(Reqts(H*),oName,oClassif,oSpec),Dissem Requirements(M*)\")\r\n\r\n			#grid.List(\r\n				path=\"/intake.db\",\r\n				page=\"#{page}\",actions,dims=\"#{dims}\",check,help,track=\"#{type}\",filter,kiss,\r\n				sorts=\"App,Tech,Test\",\r\n				selects=\"\'0\' AS _Locked\",\r\n				cols=\"_Locked.#.Lock,ID,Name,Event(App,Tech,Test),Condition(Bogus,TRL,Track,Reason),General(Special,HWConfig,SWConfig,Parms),Data Collect Requirements(Reqts(C*),iName,iClassif,iSpec),Host Env Requirements(Reqts(H*),oName,oClassif,oSpec),Dissem Requirements(M*)\",\r\n				links=\"Name.Find.Name\",\r\n				Proxy=\"/systems.proxy?&ID=?ID\",\r\n				TipMe=\"/tipset.db?&user=#{user}&system=?Name\",\r\n				Send=\"/system.view?&ID=?ID&Name=?Name\",\r\n				Open=\"/system.view?&ID=?ID&Name=?Name\",\r\n				Uploads=\"\")\r\n						\r\n			#form.Edit(\r\n				path=\"/intake.db\",\r\n				links=\"ID.List.ID\",\r\n				page=\"#{page}\",actions,dims=\"#{dims}\",help,\r\n				cols=\"Name,Event(App,Tech,Test),Condition(Bogus,TRL,Track,Reason),General(Special,HWConfig,SWConfig,Parms),Data Collect Requirements(Reqts(C*),iName,iClassif,iSpec),Host Env Requirements(Reqts(H*),oName,oClassif,oSpec),Dissem Requirements(M*)\")\r\n		\r\n		when \"guides\"\r\n			#post.Guide(path=\"/exguides.view\",dims=\"#{dims}\")\r\n			\r\n		when \"typesets\"\r\n			#post.Paper(path=\"/extypesets.view\",dims=\"#{dims}\")\r\n		\r\n		when \"mobiles\"\r\n			p Pending\r\n			\r\n		when \"briefs\"\r\n			#post.Brief(path=\"tutorial.view\",dims=\"#{dims}\")\r\n			\r\n		when \"models\"\r\n			- option = query.option || \"ExamplePython2\"\r\n			#post.Model(path=\"/exmodels.view?ver=#{option}\",dims=\"#{dims}\")\r\n			#grid.Stats(\r\n				path=\"/simstats.db\",\r\n				page=25,\r\n				cols=\"t.date,name,step.n,user,tokens,state,delay\")\r\n			#grid.Options(\r\n				path=\"/simoptions.db\",\r\n				page=25,actions,\r\n				cols=\"name,steps.n,t.n,delta.n,snappath,snapperiod.n,screen.x,url\")\r\n			#grid.SimEnv(\r\n				path=\"/apps.db\",\r\n				page=25,actions,\r\n				cols=\"Name.t,Nick.t,Title.t,DB.t,Cores.n,Sockets.c,Domain.t,PKI.c,Port.n\")\r\n			#grid.Cores(\r\n				path=\"/simcores.db\",\r\n				page=25,actions,\r\n				cols=\"engine,timeout.n,type,client,name,thread.n,index.n\")\r\n			#grid.Engines(\r\n				path=\"/engines.db\",\r\n				page=25,actions,\r\n				cols=\"Name,Vars,Engine,Code,Classif\")\r\n				\r\n		when \"charts\"\r\n			#pivot.Browser(\r\n				path=\"/intake.db\",\r\n				page=10,dims=\"#{dims}\",check,help,track=\"#{type}\",search,hold,refresh,\r\n				pivots=\"Bogus,App,Name,Tech\",actions,kiss,\r\n				cols=\"Test,Condition(TRL,Track,Reason),General(Special,HWConfig,SWConfig,Parms),Data Collect Requirements(Reqts(C*),iName,iClassif,iSpec),Host Env Requirements(Reqts(H*),oName,oClassif,oSpec),Dissem Requirements(M*)\")\r\n			#post.Force(\r\n				path=\"/force.view?src=intake.db\",\r\n				dims=\"#{dims}\",\r\n				links=\"Browser\")\r\n			#post.Cluster(\r\n				path=\"/cluster.view?src=intake.db\",\r\n				dims=\"#{dims}\",\r\n				links=\"Browser\")\r\n			#post.Fan(\r\n				path=\"/treefan.view?src=intake.db\",\r\n				dims=\"#{dims}\",\r\n				links=\"Browser\")\r\n			#post.Sankey(\r\n				path=\"/sankey.view?src=energy.json.data\",\r\n				dims=\"#{dims}\",\r\n				links=\"Browser\")\r\n			#post.omg(\r\n				path=\"/omg.view?src=intake.db\",\r\n				dims=\"#{dims}\",\r\n				links=\"Browser\")\r\n\r\n\r\n//- UNCLASSIFIED\r\n','exsite','default',0),(53,'// UNCLASSIFIED\r\n// Level 2 skin provides a lifecycle Parameter view.\r\n//\r\n// Skinning guide: [URL]/skin.jade\r\n// API guide: [URL]/icd.jade\r\n// Parameters: [URL]/parms.jade\r\n// Skins mapdrive: [URL]/skins\r\n// Theme mapdrive: [URL]/css\r\n\r\nextends site\r\nappend siteparms\r\n	view = \"Lifecycle Parameters\"\r\nappend sitearea\r\n\r\n	#grid.roles(\r\n		path=\"/roles.db\",\r\n		actions,help,page=\"#{page}\",check,\r\n		cols=\"Table,Special,Roles(INSERT,UPDATE,DELETE,SELECT,PROXY)\")\r\n\r\n	#grid.parms(\r\n		path=\"/parms.db\",\r\n		actions,help,page=\"#{page}\",check,\r\n		cols=\"Parm.t.Name,Label.t,Type,Special,Verified(V*),Type(At Input.c,At Output.c,At System.c),Stakeholder(Org*)\")\r\n\r\n	#grid.states(\r\n		path=\"/states.db\",\r\n		actions,help,page=\"#{page}\",check,\r\n		cols=\"Class,State.n,Name,Special,Supporting\")\r\n','parms','default',0),(54,'// UNCLASSIFIED\r\n// Provides model from specified model=jadefile and ver=version parameters.\r\n// See the /skin.view skinning guide and the /icd.view API documentation.\r\n\r\nextends site\r\nappend siteparms\r\n	ver = query.ver || \"test1\"\r\n	model = query.model || \"exmodels\"\r\n	view = model + \".\" + ver\r\n	if model == \"exmodels\"\r\n		parms = { \"ThreadedSWAG\":\"ver=ThreadedSWAG\",ExamplePetriNet:\"ver=ExamplePetriNet\",SWAG:\"ver=SWAG\",ExampleStateMachine1:\"ver=ExampleStateMachine1\",ExampleStateMachine2:\"ver=ExampleStateMachine2\",ExamplePython2:\"ver=ExamplePython2\",ExamplePython1:\"ver=ExamplePython1\",test5:\"ver=test5\",test4:\"ver=test4\",test3:\"ver=test3\",test2:\"ver=test2\",test1:\"ver=test1\",test6:\"ver=test6\",test7:\"ver=test7\",test8:\"ver=test8\",test9:\"ver=test9\",test10:\"ver=test10\" }\r\n	else\r\n		parms = { v1:\"ver=v1\", v2:\"ver=v2\", v3:\"ver=v3\", v4:\"ver=v4\", v5:\"ver=v5\", v6:\"ver=v6\" }\r\n		\r\nappend sitearea\r\n\r\n	dims = \"[750,500]\"\r\n	#post.Model(path=\"/#{model}.view?ver=#{ver}\",dims=\"#{dims}\")\r\n	#grid.Stats(\r\n		path=\"/simstats.db\",\r\n		page=25,refresh,\r\n		cols=\"t.date,name,step.n,user,tokens,state,delay\")\r\n	#grid.Options(\r\n		pat