abi.Change.Detect(inputs=\"obj|4|Feature Detect|helipads\",outputs=\"tracks|4\")\r\n				#mux.Mux.Tarps(inputs=\"tarp1|4|Feature Detect,tarp2|4\",outputs=\"tarps|8\")\r\n\r\n		when \"v6\"\r\n			#SIM(inputs=\"$JTEST|1\",outputs=\"tracks|4|Change Detect\")\r\n				#jpgsrv.JPG.Service(inputs=\"Chip|1|SIM|$JTEST\",outputs=\"jpg|1\")\r\n				#hack.Image.Index(inputs=\"jpg|1|JPG Service\",outputs=\"Land|9\")\r\n				#haar.Feature.Detect(inputs=\"frame|9|Image Index|Land\",outputs=\"helipads|4\")\r\n				#abi.Change.Detect(inputs=\"obj|4|Feature Detect|helipads\",outputs=\"tracks|4\")\r\n\r\n// UNCLASSIFIED\r\n','swag','default',0),(57,'// UNCLASSIFIED\r\n// Provides an intake view for a given more=0,1,2,3,4 parameter.\r\n// See the /skin.view skinning guide and the /icd.view API documentation.\r\n\r\nextends site\r\nappend siteparms\r\n	view = \"Home\"\r\n	parms = {default: \"more=0\", more: \"more=1\", \"more+\": \"more=2\", \"more++\": \"more=3\", \"more!\": \"more=4\"}	\r\nappend sitearea\r\n\r\n	#TRLs(path=\"/states.db?Class=TRL\",sync,cols=\"State,Name,Special\")\r\n\r\n	dims = \"[\'100%\',\'100%\']\"\r\n	\r\n	if query.more>=4\r\n		#fit.Welcome\r\n			#grid.News(\r\n				path=\"/news.db\",\r\n				page=25,actions,check,help,crush,refresh,filter,dims=\"[750,500]\",\r\n				cols=\"Starts.d,Stay.n,Message.h,Category.t,To.t\")\r\n\r\n			#post.big(path=\"/bigwelcome.view\",dims=\"[750,500]\")\r\n	\r\n	if query.more>=3\r\n		#pivot.Find(\r\n			path=\"/intake.db\",\r\n			page=50,dims=\"#{dims}\",check,help,track=\"#{type}\",refresh,\r\n			pivots=\"Bogus,App,Name,TRL\",actions,kiss,\r\n			menu=\"Search\",\r\n			cols=\"Test,Condition(Track,Reason),General(Special,HWConfig,SWConfig,Parms),Data Collect Requirements(Reqts(C*),iName,iClassif,iSpec),Host Env Requirements(Reqts(H*),oName,oClassif,oSpec),Dissem Requirements(M*)\")\r\n\r\n	if query.more>=2\r\n		#grid.List(\r\n			path=\"/intake.db\",\r\n			page=50,actions,dims=\"#{dims}\",check,help,track=\"#{type}\",filter,kiss,refresh,\r\n			sorts=\"App,Tech,Test\",\r\n			links=\"Name.Find.Name\",\r\n			selects=\"CAST(CONCAT(LEAST(Sign1,Sign2,Sign3),Sign0,@lock) AS CHAR) AS State, sum(datediff(queues.Departed,queues.Arrived)) AS TRLage, modlink(Module) as Model\",\r\n			cols=\"State,ID,Name,Model,Event(App,Tech,Test),Condition(Bogus,TRL,TRLage,Track,Reason,Signoff(Sign0,Sign1,Sign2,Sign3,Sign4)),General(Special,HWConfig,SWConfig,Parms),Data Collect Requirements(Reqts(C*),iName,iClassif,iSpec),Host Env Requirements(Reqts(H*),oName,oClassif,oSpec),Dissem Requirements(M*)\")\r\n	\r\n	else if query.more>=1\r\n		#grid.List(\r\n			path=\"/intake.db\",\r\n			page=50,actions,dims=\"#{dims}\",check,help,kiss,refresh,\r\n			cols=\"ID,Name,Event(App,Tech,Test),Condition(Bogus,TRL,Track,Reason,Signoff(Sign0,Sign1,Sign2,Sign3,Sign4)),General(Special,HWConfig,SWConfig,Parms),Data Collect Requirements(Reqts(C*),iName,iClassif,iSpec),Host Env Requirements(Reqts(H*),oName,oClassif,oSpec),Dissem Requirements(M*)\")\r\n\r\n	#form.Edit(\r\n		path=\"/intake.db\",\r\n		links=\"ID.List.ID\",\r\n		page=50,actions,dims=\"#{dims}\",help,\r\n		cols=\"Name,Event(App,Tech,Test),Condition(Bogus,TRL,Track,Reason,Signoff(Sign0,Sign1,Sign2,Sign3,Sign4)),General(Special,HWConfig,SWConfig,Parms),Data Collect Requirements(Reqts(C*),iName,iClassif,iSpec),Host Env Requirements(Reqts(H*),oName,oClassif,oSpec),Dissem Requirements(M*)\")\r\n\r\n// UNCLASSIFIED\r\n','intake','default',0),(58,'// UNCLASSIFIED\r\n// Provides a site framework over the layout framework.  Caller extends site, appends control parameters to siteparms,\r\n// then appends content to sitearea.\r\n// See the skinning guide (/skin.view) and the API guide (/icd.view) for help.\r\n\r\nextends layout\r\nappend layoutparms\r\n	Layout = \"Grid\"\r\n	Feature = {Themes:1}\r\nappend layoutarea\r\n\r\n	block siteparms\r\n		parms = {}\r\n		page = 50\r\n		dock = \"top\"\r\n		dims = \"[\'100%\',\'100%\',1]\"\r\n		classif = \"TBD\"\r\n		view = \"TBD\"\r\n		big = false\r\n		splash = false\r\n		brows = {Ok: [\"supported\",\"Chrome\",\"Firefox\",\"Opera\",\"Safari\"],Bad: [\"unsupported\",\"IE\",\"Netscape\",\"Traveler\",\"TheWorld\",\"Maxthon\"] }\r\n		\r\n	// global roles and parameters\r\n	\r\n	#Roles(path=\"/roles.db\",sync,cols=\"Internal,Special,INSERT,UPDATE,DELETE,SELECT\")\r\n	#Parms(path=\"/parms.db\",sync,cols=\"Parm,Label,Type,Special,Org0,Org1,Org2,Org3,V0,V1,V2,V3\")\r\n\r\n	// site style sheets\r\n	\r\n	style\r\n		.AL {text-align:left;}\r\n		.AR {text-align:right;}\r\n		.AC {text-align:center;}\r\n		.LG {font-size:15px;}\r\n		.SM {font-size:10px;}\r\n		.IN {text-indent:50px;}\r\n		.BY {background-color:yellow;}\r\n\r\n	isHome = view == \"Home\"\r\n	isOpen = \"crush\"\r\n	\r\n	#Options(path=\"#{JSON.stringify(parms)}\",cols=\"index,value\")\r\n	\r\n	if isHome\r\n		#Users(path=\"/USERS.db\",cols=\"Info,Link\")\r\n		#Themes(path=\"/THEMES.db\",cols=\"Info,Link\")\r\n		#Views(path=\"/VIEWS.db\",cols=\"Info,Link\")\r\n		#Queues(path=\"/QUEUES.db\",cols=\"Info,Link\")\r\n		#Engines(path=\"/ENGINES.db\",cols=\"Info,Link\")\r\n		#Uploads(path=\"/UPLOADS.db\",cols=\"Info,Link\")\r\n		#Stores(path=\"/STORES.db\",cols=\"Info,Link\")\r\n		#Cliques(path=\"/CLIQUES.db\",cols=\"Info,Link\")\r\n		\r\n		#border(\r\n			dims=\"#{dims}\",\r\n			class=\"#{title} #{ver} || #{view} || #{user}\",\r\n\r\n			menu=\"Users,Views,Options,Themes,Engines,Queues,Cliques,Uploads,$uploads,Stores,$stores,Edit,Home,Help(Issues,Feedback,Health,ASP,ISP,Admin,Config,Intro,Demo,API,Skinning,PRM)\",\r\n\r\n			Intro=\"/tutorial.view?more=0\",\r\n			Demo=\"/tutorial.view?more=1\",\r\n			API=\"/icd.view\",\r\n			Skinning=\"/skin.view\",\r\n			PRM=\"/prm.html.shares\",\r\n			Issues=\"/issues.view\",\r\n			Feedback=\"/evals.view\",\r\n			Health=\"/health.view\",\r\n			ASP=\"mailto:#{contact}\",\r\n			ISP=\"/admin.view\",\r\n			Admin=\"/admin.view\",\r\n			Config=\"/admin.view\",\r\n			Home=\"/intake.view\",\r\n			Edit=\"/edit.view?name=#{source}&class=#{action}\")\r\n		\r\n			#pivot.Helpful.Links(\r\n				west,crush=\"#{isOpen}\",dims=\"[200,600]\",\r\n				path=\"/sidebars.db\",cols=\"Pivot(NodeID,Topic),Special\")\r\n\r\n			#fit.Browser(south,crush=\"#{isOpen}\")\r\n\r\n				ishtml\r\n					each brow in brows.Ok\r\n						img(src=\"#{icons}/browsers/#{brow}.ico\",width=16,height=16)\r\n\r\n					each brow in brows.Bad\r\n						img(src=\"#{icons}/browsers/#{brow}.ico\",width=16,height=16)\r\n						\r\n			#folder(center,dock=\"#{dock}\")\r\n	\r\n				block sitearea\r\n			\r\n	else\r\n		#Users(path=\"/USERS.db\",cols=\"Info,Link\")\r\n		#Themes(path=\"/THEMES.db\",cols=\"Info,Link\")\r\n		#Views(path=\"/VIEWS.db\",cols=\"Info,Link\")\r\n	\r\n		#border(\r\n			dims=\"#{dims}\",\r\n			class=\"#{title} #{ver} || #{view} || #{user}\",\r\n			\r\n			menu=\"Users,Views,Options,Themes,Edit,Home\",\r\n			\r\n			Home=\"/intake.view\",\r\n			Edit=\"/skins.view?name=#{source}&class=#{action}\")\r\n				\r\n			#folder(center,dock=\"#{dock}\")\r\n\r\n				block sitearea\r\n\r\n// UNCLASSIFIED\r\n','site','default',0),(59,'// UNCLASSIFIED\r\n//\r\n	Provides a default/home/index view.  See the skinning guide (/skin.view) and the \r\n	API guide (/icd.view) for further help.\r\n\r\nextends site\r\nappend siteparms\r\n	view = \"Home\"\r\n	parms = {news:\"look=news\", intake:\"look=intake\"}\r\nappend sitearea\r\n\r\n	case query.look\r\n		when \"news\"\r\n			#grid(\r\n				class=\"Welcome || #{user} to the #{title} news\",\r\n				path=\"/news.db\",\r\n				page=25,actions,check,help,refresh,dims=\"[750,500]\",\r\n				cols=\"Starts.d,Stay.n,Message.x,Category.t,To.t\")\r\n		\r\n		when \"intake\"\r\n			#TRLs(path=\"/states.db?Class=TRL\",sync,cols=\"State,Name,Special\")\r\n		\r\n// UNCLASSIFIED\r\n','home','default',0),(60,'//- UNCLASSIFIED\r\n//-\r\n	An ICD for the integrator.\r\n\r\nextends site\r\nappend siteparms\r\n	- view = \"API\"\r\nappend sitearea\r\n\r\n	#folder.End.Points(dock=\"left\")\r\n		#fit.Routes\r\n			:markdown\r\n				>		GET /			Render the home view\r\n				> 		GET /SKIN.view		Render SKIN of specified &class\r\n				>		GET /view		Render &skin of specified &class\r\n				>\r\n				>		GET /FILE.uploads	Return FILE by NLP from the uploads (ingest once) area\r\n				>		GET /FILE.stores	Return FILE by NLP from the stores (persistant watch) area\r\n				>		GET /FILE.shares	Return FILE by NLP from the shares (static content) area\r\n				>		GET /FILE.data		Return FILE by NLP from the data (application data) area\r\n				>		GET /FILE.ENGINE	Ingest FILE using ENGINE (pdf,txt,jpg,opencv,python,...)\r\n				>\r\n				>		GET /TABLE.proxy	Proxy TABLE\r\n				>		GET /TABLE.make		Create TABLE\r\n				> 		GET /SITE.yql 		Return data from YQL compliant SITE=select/from/where\r\n				>\r\n				>		GET /socket.io		Connect to socket.io\r\n				>		GET /OBJECT.info	Information about OBJECT\r\n				>\r\n				> 		GET /TABLE.db		Return selected records from TABLE\r\n				> 		PUT /TABLE.db		Update selected records in TABLE\r\n				> 		POST /TABLE.db		Insert record into TABLE\r\n				> 		DELETE /TABLE.db	Delete selected records from TABLE\r\n				>\r\n				>		GET /ENGINE.db 		Read ENGINE \r\n				>		PUT /ENGINE.db 		Program ENGINE\r\n				>		POST /ENGINE.db		Step ENGINE\r\n				>		DELETE /ENGINE.db	Kill ENGINE\r\n				\r\n		#fit.Virtual.Tables\r\n			:markdown\r\n				This section reserved to define the `Virtual Tables`: FILES, UPLOADS,\r\n				STORES, VM, THEMES, VIEWS, USERS, ENGINES, QUEUES, TABLES, and CLIQUES.\r\n			\r\n		#fit.TABLE.Parameters\r\n			:markdown\r\n				The following parameters can be used on all TABLE requests:\r\n				> 	field=value		Select records matching specified field\r\n				>	_queue=field 		Process request using queuing field\r\n				>	_track=1		Enable change tracking\r\n				>	_search=pattern		Search pattern\r\n				>	_select=\"expr as field, ...\"	Fields to compute\r\n				>	_lock=1			Lock recrod while processing request\r\n				> 	_file=field,field,...	Return records for elFolder browsing (cmd and other parms apply)\r\n				>	_encap=field	Encapsulate _index data array in a data hash\r\n				>	_sort=[{property:\"field\",direction:\"asc\"}, ...] 	Sort specified field in specified asc/dsc direction\r\n				>	_limit=N		Limit return records to specified number of records\r\n				>	_start=N 		Start returning records from specified record\r\n				>	_client=name	Effective client in peer-to-peer sync\r\n				>	_pivot=field,field,...	Return records with grouped fields\r\n				>	_browse=field,field,...	Return records with successive grouped fields\r\n				>	_index=field,field,...	Return records as array given field indicies\r\n				>	_tree=field,field,...	Return records as tree graph given field indicies\r\n				\r\n		#fit.ENGINE.Parameters\r\n			:markdown\r\n				The following parameters can be specified on all engine requests.  See the [skinning guide](/skinguide.view)\r\n				for information on how engines are skinned.\r\n				>	itau = [{tau}, ...] input events being sinked to an engine\'s input ports\r\n				> 	otau = [{tau}, ...] output events being sourced from an engine\'s output ports\r\n				>	state = {params} event params\r\n				where engine tau events define:\r\n				>	job: \"\", 			// Current job thread N.N... \r\n				>	work: 0, 			// Anticipated/delivered data volume (dims, bits, etc)\r\n				>	disem: \"\", 			// Disemination channel for this event\r\n				>	classif: \"\", 		// Classification of this event\r\n				>	cost: \"\",			// Billing center\r\n				>	policy: \"\", 		// Data retention policy (time+place to hold, method to remove, outside disem rules)\r\n				>	status: 0, 			// Status code (health, purpose, etc)\r\n				>	value: 0			// Flow calculation\r\n				and where engine state params define:\r\n				>	step:	0, 			// simulation step\r\n				>	t:		0,			// relative simulation time (step*delta)\r\n				>	depth:	0,			// depth of queue\r\n				>	drops:	0, 			// dropped from queue\r\n				>	thread: Engine, 	// index to allocated engine\r\n				>	reset: 	0, 			// 1/0 when i/o stepping\r\n				>	name: 	\"\", 		// i/o port name state when stepping (empty otherwise)\r\n				>	index:  -1 			// i/o port index state when stepping (-1 otherwise)\r\n				\r\n		#fit.OBJECT.Options\r\n			:markdown\r\n				>	tables	list of all tables\r\n				> 	db 	database usage\r\n				>	ip	checks client-server network connectivity\r\n				>	codes	returns http error codes\r\n				>	cpu	returns server cpu info\r\n				>	user	client\'s user name provided by PKI cert\r\n				>	restart	restarts the server\r\n				>	drop	drops all clients with drop notification\r\n				>	stop	immediately stops the server with stop notification\r\n				>	loadsim	places server in load-simulation mode (N=number, lambda=events/s)\r\n				> 	table	field information on specified table			\r\n\r\n		#fit.Examples\r\n			:markdown\r\n				[ex](/test.db?_start=0&_limit=10&x=123&y=null) selects all fields from test where x=123 and y is null sort by u asc, v asc limit 0,20  \r\n				[ex](/test.db?sort=[{property:\"u\",direction:\"asc\"},{property:\"v\",direction:\"asc\"}]&x=123) selects all fields from test where x=123 order by u asc, v asc  \r\n				[ex](POST/test.db?x=123&y=null}) inserts into test set x=123,y=null  \r\n				[ex](PUT/test.db?x=123&y=null&ID=10) updates test set x=123,y=null where ID=10  \r\n				[ex](DELETE/test.db?ID:10) deletes from test where ID=10  \r\n				[ex](/parm_list.db) simply returns the entire `parm_list` table in JSON  \r\n				[ex](/parm_list.db?Parm=Band) filters the contents by `Parm=Band`  \r\n				[ex](/intake.tree?_group=TRL,VER) returns and plots the `intake` table pivoted by `TRL,Ver`  \r\n				[ex](/intake.force&pivot=TRL,Ver,Name) returns and plots the `intake` table pivoted by `TRL,Ver,Name`  \r\n				[ex](/intake.db)	Raw intake data  \r\n				[ex](/intake.view)	Skin for intake data  \r\n				[ex](/link/welcome.pdf.shares)	MIME file from shares area  \r\n				[ex](/flare.json.data)	JSON data file  \r\n\r\n	#fit.Important.Tables\r\n		#grid.Parameters.Table(\r\n			path=\"/parms.db\",page=\"#{page}\",dims=\"#{dims}\",crush,\r\n			cols=\"ID.a,Parm,Label,Type,Special,By Inspect.c,By Analysis.c,By Demo.c\")\r\n		#grid.Roles.Table(\r\n			path=\"/roles.db\",crush,\r\n			cols=\"Table.T,Special.H,INSERT.T,UPDATE.T,DELETE.T,SELECT.T,PROXY.T\")\r\n		##.\r\n		:markdown\r\n			The `Parameters Table` defines the requirement names, verification methods, and access priviledges of the \r\n			requirements held in the `Intake Table`.  \r\n			##.\r\n			The `Roles Table` defines the roles assumed when clients insert, update, delete, and select records \r\n			from a specific table.\r\n			##.\r\n			A list of `SQL Tables` is available with the `Virtual Table` route [`/TABLES.db`](/TABLES.db).\r\n			##.\r\n			`Virtual Tables` always have priority over `SQL Tables`; thus if `:table` references both a `Virtual Table`\r\n			and a `SQL Table`, the operation goes to the `Virtual Table`.  The following `Virtual Tables` provide\r\n			specific #{title} functionality by operating on the `Special` field in the `Systems` table:  \r\n			>	uploads to upload a file,\r\n			>	files to get file list,\r\n			>	spell to [spell check](https://-github.com/vesln/teacher),\r\n			>	blog to [site skin](/skin.view),  \r\n			>	nlp to [natural langauge parse](https://-github.com/NaturalNode/natural),  \r\n			>	tables to list attributes of existing SQL Tables, and  \r\n			>	web to [scape site](http://-net.tutsplus.com/tutorials/javascript-ajax/web-scraping-with-node-js/), [+](http://-www.teknoids.net/content/using-nodejs-and-jquery-crawl-public-tweets), [+](https://-github.com/ariya/phantomjs#readme), [+](http://-net.tutsplus.com/tutorials/other/an-api-for-the-web-learning-yql/)\r\n			\r\n	#grid.Error.Messages(\r\n		path=\"/issues.db?Status=System\",\r\n		page=\"#{page}\",dims=\"#{dims}\",help,\r\n		cols=\"Issue.X,Action.X\")\r\n	\r\n	#folder.Startup.and.Maintenance(dock=\"left\")\r\n		#fit.Starting\r\n			p The following are significant commands to get sigma started:\r\n			pre: code.\r\n				node sigma [service] starts service with parameters mysql.OpEnv.apps[service].  \r\n				node sigma --help lists sigma options.  \r\n				rm /var/lib/mysql/mysql.sock removes renigade mysqld locks.  \r\n				sudo service mysqld start starts underlying mysql server.  \r\n				mysql -uroot to define OpEnv.app (name, domain, port, db, resources, fault thresholds).  \r\n				cat secrets.js displays mysql passwords.  \r\n				acroread starts adobe reader for scraping pdfs.  \r\n				openoffice4 starts openoffice server for scraping docs.  \r\n				browse http://-URL/icd.view to learn about the API.  \r\n				browse http://-URL/skin.view to learn about skinning sigma.  \r\n				browse http://-URL/tutorial.view to learn about sigma.\r\n			\r\n		#fit.Windows.daemon\r\n			p Window daemons are painful (see winsw under the daemons directory).  Unix is straightforward command launch.\r\n			\r\n		#fit.Environmental.variables\r\n			p The sigma/setenv.sh will look something like this:\r\n			pre: code.\r\n				export DATA=~/data\r\n				export BASE=/opt\r\n				export NODE=$BASE/node\r\n				export CONDA=$BASE/anaconda\r\n				export SIGMA=$BASE/sigma\r\n				export APPS=$SIGMA/apps\r\n				export APP1=$APPS/app1\r\n				export SWAG=$SIGMA/python_modules\r\n				export TAUIF=$SIGMA/node_modules/tauif\r\n				export PYTAU=$TAUIF/machines/python\r\n				export CVTAU=$TAUIF/machines/opencv/objdet\r\n				export LOCAL=/usr/local\r\n				export SHARE=$SIGMA/apps/share\r\n				export node_path=$SIGMA/node_modules\r\n				export LD_LIBRARY_PATH=$TAUIF/lib:$CONDA/lib\r\n				export PATH=$CONDA/bin:$NODE/bin:$NODE/node_modules/node-gyp/bin:$CONDA/bin:$LOCAL/bin:/usr/bin:/bin:$LOCAL/sbin:/usr/sbin:/sbin\r\n				export PYTHONPATH=$SIGMA/python_modules\r\n				export PYTHONHOME=$CONDA\r\n							\r\n		#fit.Generating.Programmers.Guide\r\n			:markdown\r\n				To reproduce this guide from a **copy** for the API source use:  \r\n				`jsduck -o duckout --builtin-classes --title=\"FSGALAM API Guide\" ducksrc`\r\n			\r\n		#fit.SASS.style.themeing\r\n			:markdown\r\n				Need to add some notes here.\r\n			\r\n		#fit.Software.configuration\r\n			:markdown\r\n				Database: ODBC, MySQL  \r\n				Server: NodeJS, Python, numerous NodeJS modules (SocketIO, MySQL-connect, node-xlxs, node-windows, ....)  \r\n				Themeing: Ruby, Compass and Sass gems (compile public/resources to generate CSS theme)  \r\n				Client:  jQuery+plugins, ExtJS+plugins, JointJS, Mathjax, Reveal, D3, browserify\r\n\r\n		#fit.Browser.compatibility\r\n			:markdown\r\n				Works with Firefox (10.0.7 ESR and later), Chrome (22.0.1279.79m), Opera (12.02), and Safari (5.1.7).  Can IE support anything?\r\n	\r\n	#folder.Interfaces(dock=\"left\")\r\n		:markdown\r\n			## Client Content Management Interface\r\n			As described in the [tutorial](/tutorial.view), #{title} allows its clients to manage content with various views (and associated\r\n			technologies): grid (extjs), nav (jquery), model (jointjs), typeset (mathjax), opendb (odbc), game (voxel engine), brief (reveal),\r\n			chart (d3), gaming (voxel), and mobile (dojo).  \r\n			##.\r\n			## Programmers Interface\r\n			The programmers guide for #{title} can be found [here](shares/pgm.html).  \r\n			##.\r\n			## Admin ODBC Interface\r\n			ODBC compliant applications (like MySQL, MS Access, Excel, OpenOffice etc) can connect directly\r\n			to the #{title}.  Depending on the application, this connection can be r/o (like MS Excel) or \r\n			r/w (like MS Access).  \r\n			##.\r\n			MS Access provides a r/w connection to an ODBC table via its External Data | Link | ODBC option. \r\n			The MySQL server is access via the [MySQL command](file://-/C:/Program_Files/MySQL/MySQL_Server_5.5/bin/mysql.exe)\r\n			under user `root`.  \r\n			##.\r\n			To export a MS Access table to MYSQL:  \r\n			>		from MS Access, link to ODBC table X\r\n			>		copy the entire table (data and structure) to XCOPY\r\n			>		revise the fields in the XCOPY table as desired\r\n			>		from MySQL use `drop table X`\r\n			>		from MS Access, export table XCOPY to the ODBC table X (see MS Access export)  \r\n			##.\r\n			To import a MYSQL table into MS Access:  \r\n			>		from MS Access, select table X\r\n			>		right click and Export the table to ODBC table X    \r\n			##.\r\n			Note that the record ID on MYSQL tables should be declared as FLOAT UNIQUE AUTO_INCREMENT\r\n			to interface with MS Access.\r\n		\r\n//- UNCLASSIFIED\r\n','api','default',0);
